    title: "Statoil Cup",
    text: "IIK-Jättendal \n\nIggarna fick en bra start då Jättendal stog för motståndet i cup premiären.Ett snabbt ledningsmål efter 11 min löste upp nervknutarna.Spelet flöt på rätt bra och Iggarna kunde gå till pausvila med en 3-0 ledning.I andra var det lite lugnare med den ledningen en säker seger\nMålskyttar:Fredrik Näsman 2\n Niklas Högström 1\n Tomas Linström 1\n\nIIK-Heffners/Ortviken 0-1 (0-0)\nDet var en hård och ganska tuff match som Heffners vann på en mycket tveksam straff 11 min från slutet.IIK drabbades av ett flertal skador b.l.a Daniel Elofsson,Robert Fahlander och Mikael Rask dessutom Niklas Högström krasslig.\nÅterstår att se vilket lag vi kan ställa på benen i morgon då cupen går vidare med match mot Strömsbruk kl.10.00.Seger där och det blir semifinal.Ny rapport om det kommer i morgon.",
