    title: "Statoil Cup",
    text: "Det tog stopp för IIK i semifinalen i Statoil Cup mot Div 4 laget Svartvik som vann rättvist med 2-0 efter 0-0 i paus.\nSvartvik var det något bättre laget även om Iggarna hade några chanser 2-0 målet kom på en straff en bit in i andra halvlek sen var det klart.Inställningen hos grabbarna var mycket bra denna gång dom kämpade och slet hela matchen men räckte inte riktigt till utan föll med flaggan i topp.\nI sista gruppspels matchen blev det seger mot Strömsbruk med 2-1 en säker seger där Tommy Forslin gjorde 1-0 redan efter 1 min. Sen spädde Fredrik Näsman på till 2-0 innan Ström kunde tröstmåla på slutet.Nu forsätter uppbyggnaden med träning inför höststarten den 2/8 mot Ljusne hemma. Träningsmatch mot Enånger på Brovallen på onsdag kl.19.00",
