    text: "Enånger och Iggarna möttes ikväll i en träningsmatch inför seristarten nästa vecka matchen spelades på Brovallen i Enånger.\nIggarna gav EIK bra motstånd i första halvlek där EIK dock tog ledningen redan efter knappt 2 minuters spel efter en hörna som Håkan Westin höll sig framme på.Iggarns hade sedan ett par chanser att näta främst genom slitvargen på topp Fredrik Näsman som också var suverän i luften 2-0 kom sedan Martin Olofsson kommit helt fri med IIK:s målvakt Marcus Hell och enkelt kundew rulla in bollen.\nI andra halvleks 2:a minut blev det strul i Iggarnas mittförsvar och 3-0 var ett faktum.\nEfter det dominerade Enånger stort och kunde öka på sin ledning medans IIK spelade lite uppgivet.Planens kung var EIK:s mittfältare Daniel Hermansson som hade del i det mesta som hände främst dom första 45 minuterna.\nIIK:s främsta spelare var Fredrik Näsman.\n\nMålskyttar: Martin Olofsson 4,Håkan Westin 1,Magnus Johansson 1, Håkan Fridlund 1\n\nDomare Anders Jonsson Hudiksvall",
