    title: "IIK-Ljusne",
    text: "I femmans höstpremiär möttes Iggarna och Ljusne på Movallen,matchen spelades i stekande solsken så spelarna var rejält trötta snabbare än vanligt.Det var en spelmässigt jämn match som kunde slutat med vinst för vilket lag som helst.Ljusne inledde med en bra chans redan i 1:a minuten men skottet gick förbi målet.sedan hade IIK:s Fredrik Näsman 2 bra lägen att näta men skotten gick över.I andra halvlek forsatte spelet mest på mittplan och i den 57:e minuten var en Ljusnespelare på väg igenom som Tomas Isaksson mötte skuldra mot skuldra och nickade hem bollen till Marcus Hell i hemmamålet.Till allas förvåning så blåste domaren straff för Ljusne.Mycket tveksam sådan som Stefan Skoglund slog säkert i mål.Med 8 minuter kvar att spela nickade Fredrik Näsman in kvitteringen och alla trodde på delad pott.Men med 3 min. kvar att spela fick Ljusne en hörna som resulterade i mål och minuten senare kom 3-1 efter ett felaktigt dömt inkast som pungterade matchen.Duktig i Iggesund var Fredrik Näsman som slet matchen igenom. (Finns det nån bättre huvudspelare i Hälsingland ?? ) Ljusnes bästa spelare var målvakten Tomas Berntsson även Fredrik Tongstedt var bra.\n\nMålen: 0-1 Stefan Skoglund (sraff) 57min,1-1 Fredrik Näsman 83:e 1-2 Mårten Furubom 87:e \n1-3 Henrik Gustafsson 88:e\n\nDomare: Nils Göran Wikman Bollnäs (Tveksam )",
