    title: "Trönö-Iggesund",
    text: "Iggarna fick en mycket bra start i den här svåra bortamatchen mot Trönö i 5:an med ledning redan i 1:a minuten.Niklas Högström tog ner ett inlägg på bröstet och sköt på volley utan chans för målvakten.Ett tjusigt mål.Efter målet var IIK ett mycket piggt lag b.l.a hade Andreas Ohlsson ett inlägg som tog i insidan stolpen och längs mållinjen mycket nära ökad ledning.Sen jämnade spelet ut sig och inte mycket hände Fredrik Näsman hade en bra nick som Trönös målvakt reflexräddade i 36:e minuten.Kvitteringen kom 2 min.före paus efter att en Trönöspelare tagit ner bollen med armen och istället för frispark för IIK kom ett inlägg som nickades i mål.Andra halvlek började med en frispark strax utanför Iggarnas strafflinje som dock sköts utanför.Sen var det mycket Trönö en stund dock utan riktigt klara målchanser. Sista kvarten hade IIK ett par bra chanser att avgöra men det ville sig inte riktigt.Delad pott får nog anses som rättvist denna gång.Bra i IIK var som vanligt slitvargen Fredrik Näsman och Marcus Hell i målet.\n\nDomare: Stefan Norin Kilafors",
