    title: "IIK-Bjuråker",
    text: "Iggarna lyckades ta 3 mycket viktiga poäng i denna hårda match på Movallen.Det var mycket IIK i början med en del bra chanser och i den 21:a minuten rann Andreas Ohlsson igenom Bjuråkers försvar och helt fri rullade han enkelt in 1-0.Sen hade Iggarna en boll på mållinjen som otroligt nog sköts över.Sista kvarten av första halvleken hade nog IIK glömt då fick Bjuråker dominera efter behag.Kvitteringen kom i den 32:a minuten efter strul i IIK:s försvar.10 min senare kom ledningen med bud på mera.Andra halvlek började med stor dramatik då Andreas Ohlsson kom helt fri med Bjuråkers målvakt och blev nerriven med rutvisning och straff som följd.\nBjuråker fick ställa en utespelare i målet resten av matchen och till en början var det riktigt lyckat då han räddade Adnan Kahrimanovic löst lagda straff.Med 10 man backade Bjuråker hem för att försöka hålla sin ledning men 13 min kvar tog Fredik Näsman emot ett inlägg vände och sköt in kvitteringen\n7 min senare mötte Niklas Högström ett inlägg med pannan och segerbollen i nät.Rättvist resultat i en medioker match.\n\nMålen: 1-0 Andreas Ohlsson 1-1 Tommy Davidsson 1-2 Per Nordin 2-2 Fredrik Näsman 3-2 Niklas Högström\n\nDomare: Bengt Sandström, Vallsta",
