    title: "IIK-Gnarp",
    text: "Det går fortfarande trögt i femman för Iggarna\nmatchen började med ett par halvchanser för hemmalaget men bollen ville inte in i nätet.Istället var det Gnarp som tog ledningen efter 26 minuters spel efter lite passivt försvarsspel av hemmalaget.I den 30:e minuten hade Daniel Elofsson ett bra skott som Gnarps duktige målvakt reflexräddade.0-2 kom i den 44:e minuten efter ett inspel från högerkanten som Gnarpsspelaren mötte och sköt direkt i mål.Inledningen av andra halvlek hände inte så mycket mest spel på mitten.Efter c:a en timmes spel kom så 0-3 på ett skott från drygt 30 meter som gick via hemmakeepern in i mål och alla trodde det var avgjort förstås.Då började hemmalaget att jobba och i den 72:a minuten hade Niklas Högström en frisparkskanon som målvakten boxade ut.14 min. från slutet kom så äntligen ett hemmamål efter det att Daniel Elofsson spelat in bollen från högerkanten som Niklas Högström sköt direkt på och bollen gick via målvakten i nät.ytterligare ett mål kom i 88:e minuten när Lars-Robert Stefansson kom fri i straffområdet och kunde fastställa slutresultatet.Bra i hemmalaget var Andreas Svensson som mittback och Niklas Högström på mitten.Stor matchvinnare för Gnarp var Mikael Sundman som gjorde hattrick och var bäst på Movallen denna kväll\nMålen: 0-1 Mikael Sundman (25) 0-2 Mikael Sundman (44)0-3 Mikael Sundman (60) 1-3 Niklas Högström (76) 2-3 Lars-Robert Stefansson (88)\nDomare: Anders Jonsson Hudiksvall\n\nPublik: 63",
