    text: 'Efter en lite trevande start mot serietvåan Hällbo tog vi över och skapade många chanser utan att få utdelning.IIK fick mittbacken Mikael Stark knäskadad redan efter 12 min och förlorade då en mycket bra huvudspelare men spelet blev allt bättre även om Hällbo stack upp ibland och hade några halvchanser som "Bagarn" (våran målvakt) lätt tog hand om.\nAndra halvlek forsatte i samma spår som första och vi började ställa in oss på en poäng.Då slank Andreas Ohlsson igenom på vänsterkanten och med en minut kvar av matchen sköt han ett bra skott som gick i en båge över Hällbos utrusande mv.Stort jubel i hemmalaget som nu kan få lite andrum i tabellens nedre hälft.\nBra hos iggarna var denna gång Robert Karlsson i målet även Daniel Elofsson bör nämnas för sitt slit matchen igenom.\n\nMålet: 1-0 Andreas Ohlsson (90 min)\n\nDomare: Per Tapper , Söderhamn\n\nPublik: 63',
