    id: "93a45204-b709-45f8-b734-e9491aeef6ab",
    title: "Viksjöfors-IIK",
    text: "En olycklig start för Iggarna som misslyckades med att ställa en Viksjöforsspelare offside ledde tiil att Viksjöfors kunde ta ledningen redan i den 1:a minuten på ett friläge.Sen jämnade spelet ut sig utan att det blev några heta målchanser.I den 16:e minuten missade en av linjemännen en offside som ledde till att Viksjöfors kunde öka till 2-0 på ett nytt friläge.Efter en dryg halvtimmes spel kom så en reducering.Det var Micke Rask som gjorde ett långt inkast och efter diverse studsar så hamnade bollen i mål och Iggarna fick hopp om att kunna ta en pinne.Men efter 41 minuter kom ett inspel från höger till en fristående Viksjöforskille som avslutade med ett bra skott.Andra halvlek började IIK optimistiskt med att skapa en del chanser utan att kunna sätta dit bollen.Så efter 55 minuter gjorde Viksjöfors både 4-1 och 5-1 på mindre än en minut.Två identiskt lika mål där dom sprang rakt igenom IIK:s försvar.En reducering kom i den 60:e minuten genom Daniel Elofsson som fastställde slutresultatet till 5-2.Iggarna kan betydligt bättre förhoppnings vis redan på lördag då Rengsjö kommer till Movallen på besök.",
