    title: "IIK-Rengsjö",
    text: "Matchen började med ett skapligt tempo och Iggarna hade det mesta av spelet i början utan att skapa några direkt vassa målchanser.\nEfter drygt 30 min stack Rengsjö upp med ett inspel från höger som Alf Blom tog emot och sköt säkert gästerna till ledning.I den 41:a minuten slog Daniel Elofsson en hörna som Robert Fahlander mötte med ett direktskott som dock en Rengsjö back kunde rensa undan på mållinjen.Iggarna saknar den lilla tur som behövs för att ta poäng.Andra halvlek var bara 4 minuter gammal då Rengsjö ökade på till 2-0.Lasse Hedqvist fick en långboll som han tog ner och bara rullade in med hjälp av stolpen.5 min. senare kontrade IIK in 1-2 genom Tomas Enqvist som fri på vänsterkanten säkert kunde slå in bollen och Iggarna fick nytt hopp om poäng i denna viktiga match.I 66:e minuten hade Adnan Kahrimanovic ett bra volleyskott som Rengsjös målvakt tippade till hörna.Samme man hade sedan ännu ett bra skott som tycktes vara på väg i mål men mv. Krister Persson sträckte ut och fick bollen till hörna.Så iden 81:a minuten släckte Lasse Hedqvist allt hopp för hemmalaget då han kontrade in 3-1 för gästerna.Bra i hemmalaget var Mv.Robert Karlsson och Mb. Niklas Högström\nBäst host gästerna var Magnus Mickelsson och forwarden Alf Blom.\n\nMålen: 0-1 Alf Blom (31) 0-2 Lasse Hedqvist (50) 1-2 Tomas Enqvist (55) 1-3 Lasse Hedqvist (81)\n\nDomare: Anders Jonsson, Hudiksvall\n\nPublik: 63",
