    title: "Ilsbo-IIK",
    text: "Iggarna började med ett virrigt försvarsspel som gav Ilsbo en del chanser att näta men med lite tur höll man tätt.Efterhand kom IIK in i spelet utan att skapa några målchanser.Kanske var det tur att det var mållöst i första halvlek.Andra halvlek var bara 4 minuter gammal då en Ilsbokille var på väg igenom Iggarnas försvar men blev nerdragen och frisparken som föjde förvaltades till 1-0.Då började hemmalaget slå vakt om sin ledning och IIK kunde sticka upp allt merDet dröjde till 72:a minuten innan man fick utdelning då Niklas Högström skickade in bollen från höger och Lars-Robert Stefansson mötte och sköt direkt 1-1.Då steg förhoppningarna hos Iggarna att ta 3 poäng.Men så med 14 min.kvar fick Ilsbo en frispark till vänster som slogs in och Dan olsson kunde nicka in 2-1.3-1 kom sen efter lite kalabalik framför IIK:s mål och hemma segern var i hamn.Nu krävs det skärpning dom 2 sista matcherna om IIK vill vara kvar i 5:an nästa säsong.Vi möter Järvsö på Movallen på Lördag och där måste det nog bli en seger.\n\nMålen: 1-0 Love Olsson (50) 1-1 Lars-Robert Stefansson (72) 2-1 Dan Olsson (76) 3-1 Mikael Andersson (85)\n\nDomare: Bo Camel, Bergsjö",
