    id: "6cab9791-7f62-47fe-9ec0-9fe4c268ea01",
    title: "IIK-Järvsö",
    text: "IIK tog en mycket skön seger mot Järvsö som besegrades med 3-2. Efter en lite trevande inledning med Järvsö som det något piggare laget kom iggarna in matchen efter en stund.Comebackande målvakten Mikael Sondell hade en del att bestyra och det gjorde han mycket bra.I den 28:e minuten kom ledningsmålet för hemmalaget när Adnan Kahrimanovic slog en hörna som han sedan fick tillbaka och drev in i straffområdet och sköt ett bra skott i målvaktens bortre burgavel.Då kom Järvsö tillbaka något och skapade några chanser utan att kunna avsluta.4 min före paus rev IIK:s målvakt ner en Järvsöforward med straff som följd.Straffen slog Marcus Danielsson i ribban och 1-0 stod sig halvleken ut.I andra halvlek var det spel fram och tillbaka utan några rejäla målchanser.så i den 67:e minuten utnyttjade Daniel Elofsson ett schabbel i Järvsös backlinje och kunde göra 2-0 med ett bra skott som gick stolpe in.Daniel höll sig framme igen och slog in 3-0 på en retur sedan Fredrik Näsman hade skjutit ett bra skott.Segern tycktes säker men så fick Järvsö en straff som förvaltades säkert till reducering:Så 3min före slutet fick Järvsö nytt hopp om poäng då man fick en indirekt frispark i IIK:s straffområde sedan IIK:s målvakt hade plockat upp en bakåtpassning.Frisparken slogs stenhårt rakt upp i krysset.Men närmare än så kom inte Järvsö den här gången.Bra i IIK denna dag var Mikael Sondell i målet ,Micke Rask som libero och 2-målskytten Daniel Elofsson.Bäst i Järvsö var innerbackarna Magnus Andersson och Torbjörn Andersson.\n\nMålen: 1-0 Adnan Kahrimanovic (28) 2-0 Daniel Elofsson (67) 3-0 Daniel Elofsson (85) 3-1 Peter Andersson (86 straff) 3-2 Magnus Andersson (88)\n\nDomare: Per Tapper Sandarne\n\nPublik: 63\n",
