    id: "804404d1-2058-49bb-983d-490740ada2f8",
    title: "Hög-IIK",
    text: "Så är då säsongen över och århundradets sista match är spelad för IIK:s lag i Div 5.Trots att det blev storförlust mot ett starkt spelande Hög på Kungsvallen så var det ändå glada miner i Iggarnas omklädningsrum efter matchen.Glädjen förklaras med att för första gången detta år så hade IIK lite flyt och fick ta hjälp av andra lag för att stanna kvar i serien.Tack till Bergsjö som tog säsongens första seger mot Trönö på bortaplan och tack också till Ljusne som orkade kämpa mot Gnarp trots att dom redan var klara.I matchen mot Hög var det inget snack om vilka som var bäst.Hög som är höstens lag och tog nu sin 8:e raka seger.Matchen spelades på en mycket hal plan med ihållande regn hela matchen.Hög tog ledningen efter 12 min på en snygg nick i krysset av Håkan Westberg.Iggarna hade chans att kvittera när Andreas Ohlsson fick 2 chanser men målvakten i Hög klarade galant.I den 32:a minuten kom så kvitteringen då Niklas Högström stal bollen i Högs backlinje och säkert slog in bollen.1-1 stod sig sen halvleken ut men ett klart övertag för Hög.Andra halvlek var bara 6 min gammal då Hög åter tog ledningen denna gång på en hörna som långe Olle Skoglund skallade in via målvakten.3-1 kom på en retur efter ett skott och då höll sig mittbacken Mikael Högbom framme och nätade.sen kom det 2 mål till för Hög under dom sista 5 minuterna.Hög var det klart starkaste laget i denna match och medelåldern i lagen var säkert Hög 10 år äldre än unga IIK som har framtiden för sig.Bra hos IIK var som vanligt mittfältaren Niklas Högström som jobbade och slet matchen igenom.Bäst hos hemmalaget var mittbackarna Olle Skoglund och Mikael Högbom.Nya motståndre för IIK nästa säsong blir nu Arbrå och Näsviken som kommer från 4:an och Växbo och Strömsbruk från 6:an\n\nMålen: 1-0 Håkan Westberg (12min) 1-1 Niklas Högström (32) 2-1 Olle Skoglund (51) 3-1 Mikael Högbom (60) 4-1 Hans Svensson (85) 5-1 Olle Skoglund (88)\n\nDomare : Benny Johansson, Arbrå\n",
