    title: "Mohed/Bergvik - Ankarmon",
    text: "Då kom det! Årets bottennapp. Denna match var över på 15 min då hade hemmalaget tagit ledningen med 4-0. Det var inte många rätt från Ankarmons sida då. Spelet blev bättre ju längre matchen gick. Men den första kvarten förstörde det mesta. Alla tjejer i Ankarmon kan bättre.",
