    title: "Strand - IIK P13",
    text: "Ett äkta hattrick av John Nätterlund genom de 3 första målen, på ca:15 min, i 1:a halvlek.\nMikael Wikberg gjorde 0-4 och 0-5 innan halvleken var slut. På ett som vanligt!? blåsigt Ullsäter avslutade Erik Sundman målfabrikationen genom att fastställa slutresultatet till 1-6. Som vanligt bra inställning och hårt arbete bidrog till att vi fick med oss 3 poäng hem.\n",
