    title: "P-13 Harmånger-Iggesund",
    text: "Det syntes att det var 3:e matchen på 6 dagar\n,men trots 'halvfart' var det klasskillnad mellan lagen.John Nätterlund 3 mål, Erik Sundman 2 mål, Fredrik Forslin 1 mål, Mattias Jonsson 1 mål, Joakim Eriksson 1 mål. Vi laddar 'stenhårt' inför DM-finalen mot Mohed lördag 21/8 Movallen kl.1600.",
