    text: "Naturligtvis ett lättare motstånd än Mohed, men mot Färila fungerade spelet igen. Bra inställning och kämpatakter gjorde att segern \ntill slut skrevs till klara 1-9. Ett extra plus till yttermittfältarna och ytterbackarna, som höll bra bredd på spelet.\n3 mål: Erik Sundman. 2 mål: Micke Wikberg,\nJohn Nätterlund och Jocke Eriksson.",
