    title: "IIK P13 - ABK/Näsviken",
    text: 'Trots bra spel och kraftigt spelövertag förlorade vi vår första seriematch, mot jämngamla motståndare, någonsin. ABK/N backade\nhem och satsade på långbollar från försvaret,\ntråkigt men effektivt. Vi spelade bra, men var alltför ineffektiva framför deras mål. Trots allt en nyttig "läxa" för oss.\nErik Sundman 1 mål.\n',
