    title: "IIK P13 - Färila",
    text: "SERIESEGRARE!! \nKlasskillnad mot Färila.\nErik Sundman 3 mål, John Nätterlund 3mål, Micke Wikberg 2 mål, Jocke Eriksson 2 mål.\nFredrik Enberg 1 mål,Erik Pettersson 1 mål Roligt att övergången från 7-manna till \n11-manna fotbollen gått så bra.\nSerien: Vi tog 39 poäng av 42 möjliga,\nmålskillnad 115-14. Vi återkommer med lagbild\npå killarna.\n",
