    title: "F-17 Iggesund-Mohed",
    text: "En match som vi spelade på Brovallen i Enånger. Det blev en mycket bra match tjejerna det märktes att dom ville vinna alla gav 110% hela matchen.\nVi hade det mesta av spelet vi skapade många\nmålchanser ifösta halvlek men bollen ville inte in vi fick ett mål bortdömt på grund av offside.\nI andra halvlek fortsatte vi samma bra spel,\nefter ca 20 min så kom seger målet av Helene Nilsson det var skönt att vi fick vinna denna match.Nu är vi stärkta till nästa match som blir mot Team Hudik som vi spelar hemma 26/8\nså då vill vi att alla kommer och hejar på oss\nföräldrar som kompisar!!!!!!!!!!",
