    title: "Iggesunds F-17-Team Hudik",
    text: "Det var en jämn match i första halvlek, vi började att ta ledningen med 1-0 de första 5 minuterna som Maria Holmin gjorde. Sedan gjorde Hudik två mål, när det var tio minuter kvar så kvitterade vi till 2-2 genom Madde Zetterlund på en hörna.Sedan hade vi otur med ett skott i ribban i stället för nättaket.\nI andra halvlek blev det sämre, vi orakade de första 15 minuterna sen så ramlade målen in för Team Hudik när våran ork tog slut. Den sista minuten så slut ställde Hanna Svensk resultatet till 3-7...\nAlla tjejer kämpade hårt å tappert!\nTack för publik stödet som vi fick...\n // Madde Zetterlund",
