    text: "Så var det dax att spela sista matchen för säsongen .Vi fick åka till Edsbyn för att spela denna match,det blev ett ungt lag som åkte med många spelare från F-13.\nDet var en tunggräsmatta och slirig så det var tungspelat vi spela denna match med mycket kämpa ,all flickorna gjorde sit bästa plus lite till det blev en rolig sista match vi sa före avspark att vi nu skulle spela och ha roligt.\nmålgörare var Madde Zetterlund med 3 mål var av 2 mål gjorda på frispark direkt i mål.\nNu väntar bara våran avslutning som kommer att bli att vi åker till Boda Borg den 17/10.\nJag Roger Zetterlund och Stefan Svensk vill tacka för ett trevligt FotBolls år som har varit långt men roligt, vi tackar all som har varit med med ett stort TACK!!!!!!",
