    title: "P11 Iggesund-Delsbo2",
    text: "Efter lite tvekan kom grabbarna igång. Två mål av Andreas Midell gav 2-0 i första halvlek. Andra halvlek fortsatte med samma kämpaglöd och efter ett tag kom 3-0 inslaget av Jens Berg. Delsbo saknade inte chanser, men dessa motade vår eminenta målvakt Tobias Roos som gjorde en kanonmatch. Delsbo missade även två straffar. Som helhet gjorde hela laget en kämpainsats. Domaren L.Vestling gjorde ett stabilt intryck.",
