    title: "P-17",
    text: "990823 Bollnäs-Iggesund P-17 0-3\n\nFörsta halvlek en tämligen trög historia men ändå en ledning. Andra halvlek försöker Bollnäs att trycka på och då började spelet öppna sig. Vi får igång spelet och börjar rulla boll till varandra. Ingen tvekan om vart segern skulle gå. Som en av Bollnäs ledare sa ¨tack för lektionen¨. Än så länge är vi fullpottare i slutspelet.\n\nVid datorn Hans Westling",
