    title: "F:15 IIK-Vallsta",
    text: "Målgörare Emma Svensk o Elin Larsson.\nTjejerna kom igång efter en nervös inledning. Bra samspel o mycket bra markering. Svårt med avslut. Men vi är mycket nöjda med matchen .\nSkulle haft ett par mål till.\nMats",
