    title: "F:15 Bergvik-IIK",
    text: "Målgörare : Elin Larsson\nVärlden är allt bra orättvis!\nIIK`s tjejer har bollen i stort sett hela matchen, med bra spel, fina uppspel längs kanterna med härliga inlägg som följd, men vi får inte in bolluslingen ändå. Svårt med avslutningarna. Bollen studsade ej vår väg. Men vi kommer igen.\n Mats Larsson",
    score: "2-1",
