    id: "29904a24-3aaa-4314-8068-85745ac48853",
    title: "P10 - Näsviken",
    text: "En gastkramande regnmatch. Iggesund spelade klart under sin förmåga och kom snabbt under med noll - två. Efter ett snack i halvtid blev det betydligt bättre takter och segermålet slogs in med endast 16 sekunder kvar att spela.\n\n",
