    title: "P-12 Iggesund-Hög",
    text: "Efter första halvlek i ledning med 2-1.Vi pressade på bra, i slutet av matchen var det bara vi mot Högsmålet,men vi lyckades inte sätta ett par frilägen. Dan Hultman och Kristoffer Larsson gjorde IIK's mål.",
    score: "2-3",
