    title: "P11 - Mohed",
    text: "Hemmapremiären klarades av med seger -två raka nu.\n\nSpelet var tidvis mycket bra men varvades med rena bottennapp. Det nya systemet med endast två försvarare 'läckte' betänkligt.\n\nvi tackar domare Kjerstin Skjärvold för en nära nog felfri insats och tar nya tag mot Rengsjö nästa vecka.\n\nTräning måndag 21/5 klockan 16.30\n\nLars-Tony",
