    title: "Iggesund 2 - Forsa 2 H",
    text: "Detta var en mycket bra 0-0 match för det saknades inte chanser. Hemmalaget stod för det bästa spelet men Forsa hade farliga kontringar. Den första känslan som föll sig in var en besvikelse för att vi ej vann. Vi brännde många chanser vissa väldigt klara. Domar insatsen i matchen var mycket bra. Vi går ej in på spelarbetyg utan ger hela laget en jätte stor ros för en bra genomförd match.",
