    title: "Herrar Iggesund 2 - Tallåsen",
    text: "Detta var en match med två ansikten. Första halvlek spelade Iggesund bra fotboll vi sa till varandra i paus att nu går vi ut och höjer tempot ett hack till. Men så blev ej fallet utan Tallåsen gjorde 0-1 på ett misstag från våran backlinje. Sedan rann det iväg och Tallåsen gjorde tre mål till. Bäst i hemmalaget var Fredrik Persson.",
