    title: "DM jun Mohed - IIK Herrar",
    text: "Kanonväder!! Kanonplan!! Kanonresultat!! Vi var helt enkelt bättre än Mohed. Kul att coacha ett lag med sådan inställning. \n Målskyttar: Daniel W. 2 st, Armin B. 2 st, Daniel H 1 st.\n ABK nästa i semifinal!!",
