    text: "Efter regn kommer sol...så var det i går när vi åkte till Ljusne för att spela match. Fotbollsplanen såg ut som träsket med högt gräs och vattenpölar. \nI 12 min satte Evve in första målet och i den 26 min satte hon det andra.Titti gjorde vårat tredje mål i 55 min. Evve fick åt sig en straff som Saara Kurvinen la men tyvärr sköt över. Vi hade ledningen med 0-3 när det var 5 min kvar av matchen, då gjorde de 2 snabba snygga mål som Lena försökte stoppa men de gick rakt i tak. Komentar..vi har spelat bättre, jag vet att flickorna har bättre kundskap. \nDagens slivarg: Evve. \nNäsa match måndagen den 1/7 kl. 19.30 hemma mot Vallsta.\n",
