    title: "IIK F13-Delsbo",
    text: "Vill tacka alla flickor för en väl spelad match.\nSom vanligt när vi möter Delsbo har vi oturen på vår sida.... stolpe ut, ribba ut, på utsidan av nät jag kan fortsätta upprepa men det hjälper inte. Delsbo gjorde ett fint mål i sista sekunden en lobb som Lena ej nådde fast hon hoppade.\nDet var den sista matchen för denna säsong och som det ser ut nu kommer vi troligen att hamna på fjärde plats i serien A-gruppen.\nVill även tacka ALLA föräldrar som har så här fina barn.",
