    id: "7898fcfb-eca2-45f3-8a6b-01a26d608745",
    title: "Team Hudik - IIK F14",
    text: "Så var årets första seriematch i F-14 serien avklarad för tjejerna i IIK F-14.\n\nDet blev en rivstart där Ivana Maric´ tog steget fullt ut som målskytt, 1-0 till IIK efter 1.03. Det resultatet stog sig halvleken ut.\n\nAndra halvlek började som den första Kristin Stillmark slog in 2-0 efter 2.03 och Ivana sitt andra för dagen efter 4.40 sedan böljade spelet fram och åter över planen och de få gånger Saara släpte förbi något bakom backlinjen plockade Lena i målet det med säker hand.\n\nMarie Markström fastställde slutresultatet på straff i slutminuten till IIK seger med 4-0.\n\nBländande insatts av alla tjejer.\n\nm.v.h. Anders Hallin",
