    title: "Edsbyn - IIK F 14",
    text: "Första halvlek inleddes lite trevande från båda håll, spelet gick lite fram och tillbaks. I 14:e minuten lirkade Evelina in IIK´s första, då lossnade spelet för IIK tjejerna och 2:an satte Kristin i 23:e minuten och 3:an skickade Ivana in två minuter senare. Tyvärr fick Jennifer släppa en slump boll förbi sig i sista minuten före vilan.\n\nI andra halvleks inledning skärpte Edsbyns tjejer sig rejält, och 2-3 målet kom tidigt redan efter 5 minuter. Men som så ofta förr när ett lag trycker på för kvitering kommer baklängesmål, Kristin tackade för ytorna bakom Edsbyns backlinje och slog in 2-4 när åtta minuter återstog och 2-5 fyra minuter senare.\n\nSegern var klar och rättvis. BRA KÄMPAT TJEJER !\n\nm.v.h. Hallin",
