    id: "6ea2c58c-0497-4358-95c9-bb5be1520c80",
    title: "F14 IIK - Ljusdals IF",
    text: 'IIK F-14´s hemma premiär kunde inte bli bättre !\n\nRegnet föll på förmiddagen, och ett par timmar före matchstart bröt solen igenom. På nyvattnad plan och strålande sol blåste så domaren Fredrik Forslin till avspark, och Ljusdal startade starkast. De välväxta Ljusdals tjejerna tryckte på med allt dom hade och IIK såg lite överaskade ut med det tempo gästerna gick på i. Gästerna tog så ledningen 0-1 efter 6,40. IIK bet ifrån och började så smått komma till framåt, de blev hårt tagna när dom anföll och i 11 minuten fick IIK frispark i bra läge. Marie Markström joggade upp lag bollen på plats och slog in 1-1 på en snopen Ljusdalsmålvakt. Spelet fortlöpte med växelvisa anfall och i 17:e minuten slog Ljusdal in 1-2 det stog sig till paus.\n\nI andra halvlek märktes tydligt att Ljusdal hade sprungit sig trötta i det hårda öppnings tempot, det vart bara ett lag kvar på plan. 2-2 slog Kristin Stillmark in i 35 minuten, i 39:e var det dags igen för Marie 3-2, Kristin fyllde "hat tricket" igen 4-2 i 44 minuten och 5-2 i 51:a.\n\nEn mycket strång insatts av HELA LAGET i denna tidiga seriefinal.\nm.v.h. Anders Hallin',
