    id: "0291952e-fea1-4916-a8f4-34c15e5924c9",
    title: "IIK F-14 - Viksjöfors",
    text: 'Den här matchen hade dubbel betydelse \n(serie och F14 cup), och det märktes på båda lagen.\n\nIggesund förde matchen på en blöt och hal plan, det dröjde ända till 10 minuten innan Kristin Stillmark slog in 1-0. Efter det ledsnade Elin Salmela i Viksjöfors och gick rakt igenom IIK laget och slog in 1-1 i 12 minuten. Men IIK hade taktiken klar, långa bollar haglade förbi Viksjöfors backar, i 15:e minuten nätade Evelina Rösnäs 2-1, i 19:e var det dags för Kristin igen 3-1, men i 30:e körde Elin i Viksjöfors en målgivande rusch igen 3-2.\n\nI andra halvlek såg det ut likadant, långa bollar över Viksjöfors backlinje, i 42:a minuten nådde Evelina en av dom och slog in 4-2 reprisen kom i 51:a minuten Evelina fyllde "hat tricket" 5-2 då surnade Elin i Viksjöfors till igen körde en rusch igen och gjorde även hon ett "hat trick" 5-3. I 59:e minuten fick vi skriva ett nytt namn i mål listan, efter en målvakts retur petade Caroline Hultman in 6-3 som också blev slutresultat.\n\nEn bra taktisk genomförd match, men att en och samma tjej går rakt igenom 3 gånger får inte hända.\n\nBra kämpat, nu väntar Edsbyn i semifinal i F-14 cupen.\n\nm.v.h. Anders Hallin',
