    title: "F-14 IIK - Delsbo",
    text: "Så var då säsongens sista hemmamatch i F-14 serien spelad och motståndet stog Delsbo för.\n\nIIK öppnade med ett spel som fick Dellborna att se ut som rundningsmärken. Karin Bjellman slog in 1-0 på en målvaktsretur efter dryg minut, sedan var det fyrverkeri från Evelina Rösnäs 2-0, 3-0 och 4-0 innan Delsbo reduserade till 4-1 strax innan paus.\n\nI andra halvlek var spelet jämnare även om IIK fortfarande förde spelet, Evve pytsade för fjärde gången 5-1, Kristin Stillmark tyckte att nu måste det vara min tur och slog in 6-1 målet och fastställde slutresultatet.\n\nJätte kul att Karin fick utdelning för allt spring och slit 1 mål och 2 målpass, men KONON SPEL av hela laget.\n\nGrattis till en TOPP MATCH TJEJER !",
