    id: "bf5331cb-b565-4f63-b635-dbe3ae719e08",
    title: "F-14 Team Hudik - IIK",
    text: "Serie final i F-14 serien. Både Team Hudik och IIK var obesegrade innför detta möte, och båda hade två oavgjorda varav en var första mötet mot varann.\n\nIIK tog tag i matchen från start, mycket spel på T/H´s planhalva. I 6:e minuten slog Marie Markström ett perfekt inlägg från vänsterkanten och Kristin Stillmark satte dit pannan och 0-1 var ett faktum. Sedan var spelet jämnare även om det var IIK som förde det dröjde ända tills 28:e match minuten innan Evelina Rösnäs kunde rulla in 0-2 efter en tilltrasslad situation framför T/H´s mål.\n\nI andra halvlek fortsatte det vara jämt spel T/H hade en riktigt bra chans men Sandra Söderström rensade på mållinjen, det var den enda gången Lena Skjärvold hamnade fel i denna match STORT spel av henne. IIK hade också några chanser framåt men det dröjde ända tills i slut minuterna tills 0-3 satt det gjorde Johanna Skarin på straff efter en fällning på Kristin Stillmark.\n\nStraffen kom som på beställning eftersom vi övade straffläggning på träningen dagen innan. Den vann Johanna.\n\nEn match kvar i serien tjejer. Viksjöfors borta, är ingen lätt match så bit ihop så är serie segern klar.\n\nHEL SKÖN SEGER, KANONSPEL AV HELA LAGET.",
