    title: "IIK P93 - Jättendals IF",
    text: "Hemmaprmiär på bortaplan..ja så kan det vara.\nBorta var vi också större delen av matchen vilket ju resultatet tydligt visar. Jättendal hade några riktigt bra och snabba spelare som gjorde lite som de ville och vi hade framförallt inte den rätta gnistan och inställningen som krävdes för att stoppa dem.\n\nMål fick vi i alla fall göra, fast vi fick hjälp av Jättendal med detta. En hörna från Victor som de styrde in i egen bur.\n\nBäst i Iggarna var Anton Åkerlund som klev in i andra som mittback och gjorde det mycket bra samt Emil Hallberg som visade bra inställning och kämpaglöd.\n\nLaget:\nMartin Söderstedt - Oskar Axlund,Robin Larsson,Calle Danielsson-Victor Hallberg, Wille Groth, Emil Hallberg - Marcus Eriksson, Andreas Andersson, Jimmy Rösnäs-Erik Söderstedt, German, Anton Åkerlund, Oskar Åkerlund.\n\nMålet: Självmål",
