    title: "IIK Herr - Enångers IK",
    text: "Målskyttar för IIK:\n1-0 John Lärka\n2-0 Tommy Forslin\n3-1 Mattias Samuelsson\n4-1 Jacob Tysk\n\nSå startade Iggarna:\nThomas Ludwichowski - Olof Westling, Melker Öberg, Kalle Ek, Håkan Persson - Jacob Tysk, J-O Svedberg, Thomas Söderlund, John Lärka - Tommy Forslin, Mattias Samuelsson.\nAvb: Erik Elserth, Anders Hallberg\n\nDomare Sune Nilsson, Iggesund.",
