    id: "0f01707c-bd4e-4a91-b87e-ad82c7c87723",
    title: "Loos - IIK Herr2",
    text: "Ny vinst för Herr2 i norra sjuan. Ett ungt (Fredrik Forslin äldst, han är 86:a) IIK2 spelade bra och stabilt och tog en rättvis seger.\n\nSurasak gjorde debut mellan stolparna och gjorde det med bravur. Nollan hölls och han nöp dessutom en straff.\n\nDagens plusare:\n+++ Martin Lööf\n++ Surasak Saisaen\n+ Niklas Nordström\n\nMålen:\nAndreas Midell 2\nNiklas Nordström 1\nMikael Andersson 1 \n",
