    title: "Mittnordencup F17-Kalix Damfotboll",
    text: "Rapport i från Timrå, Våra F17 tjejer började cupen med en fin kämpainsats av hela laget genom att spöa Kalix med 3-0. Målen gjorda av 1-0 Emma.L ifrån en fin lagd frispark från ca 30 meters håll rätt i krysset, 2-0 utav måltjuven Fia som höll sig framme vid motståndar målet och snodde ´bollen framför kalix vilt kämpande målvakt. 3-0 satte Bella in vid vänstra stolpen efter att snurrat upp kalix försvaret. Och nu Ladddas batterierna med Chips och morötter till morgondagens matcher (2 st.) // Tony & Micke",
