    id: "6f7daaf3-62f7-4943-a1d6-9af54e310a89",
    title: "IIK P11 - Enånger",
    text: "Säker 3-poängare utan att övertyga.\n\nTisdagens derby mellan Iggesund och Enånger blev en ganska avslagen historia. Ett Iggesund med ovana positioner slet inte direkt ihjäl sig idag utan gjorde vad som behövdes men inte mer.\nStundtals visade vi upp de fina kombinationer som vi vet att vi kan men vi hade förtvivlat svårt att få till avsluten.\nInför matchen hade vi tränat på en ny hörnvariant som vi tänkte testa men att vi bara fick två tillfällen att testa den på under hela matchen skvallrar väll om att vi tappade bort för många bollar innan avsluten kunde komma.\nEnånger hade några killar som var riktigt duktiga och deras taktik gick väll ut på att köra utsparkar mot dessa och sedan att backa hem med minst 4-5 spelare.\nVi förbjöd utsparkarna för nu skulle vi rulla boll och det gjorde vi också oftast bra, de ovana positionerna gjorde väll att ibland så fans det ingen där det skulle vara folk för att ta emot passningarna.\nEnånger får ta ledning på en hörna i minut 8 men vi var aldrig riktigt oroliga för vi visste att vi spelade bättre fotboll. Kvitteringen kommer också rättvist i minut 17 då Leo tar ett bra inkast till Olivier som sätter avslutet i bortre burgaveln. Fler mål blir det inte innan halvtidsvilan.\n17 minuter in i andra tar vi ledningen på ett snyggt mål då Markus rullar ut till Rasmus som tar fart efter högerkanten och petar fram bollen till Acke i straffområdet som kan sätta 2-1 på sina gamla lagkamrater. Målskyttet avslutas 9 minuter före full tid då Jeppe drar en frispark från vänster strax utanför straffområdet som går direkt i mål. Beröm för det målet ska även Olivier ha som gjorde ett bra arbete med att täcka målvakten.\n\nNyttigt att få prova på ovana positioner även om det blir yrigt emellanåt.\n3 nya färska poäng och det ska vi naturligtvis ge beröm för. Även om vi inte slet ihjäl oss så gjorde vi vad som krävdes för att bärga 3 poäng och det var väll det som var huvudsaken.\nTill nästa match krävs att vi är tuffare i närkamperna och springer mer, men jag tror nog att vi kan gå in i den matchen med rätt inställning då vi vet att Ljusne är ett bra lag.\n\nMålen:\n1-1 Olivier Lindh (17)\n2-1 Axel Olsson (47)\n3-1 Jesper Lindén (51)\n\nVi som spelade:\nMålvakt: Markus\nBackar: Anders, Gustav, George och Anti\nMittfält: Linus, Ogge, Leo, Acke, Jeppe och Rasmus\nForwards: Olivier och Jonte\n",
