    id: "81770275-d3f0-4b56-bde7-d0dd9b29053b",
    title: "Enånger - IIK P11",
    text: "Träningsmatch\n\nEfter en välbehövlig vila för våra VM hjältar ställdes vi i höstsäsongsgenrepet mot lokalkonkurrenten Enånger. Ett Enånger som vi ”bara” lyckades slå med 3-1 hemma i serien.\nEtt gäng revanschlystna grabbar anförda av förre EIK:aren Acke Olsson skulle nu visa Enångrarna hur vi kan spela när vi är på topp.\n\nGrabbarna tar kommandot direkt vid avspark och för spelet halvleken igenom, dock lyckas vi inte få nån direkt fart i passningarna utan det dröjer ibland för länge innan de slås, sen när de väl slås är de ofta så geniala som vi är vana att se men då har redan Enånger hunnit ställa om.\n1-0 kommer ändå tidigt i matchen då George lägger en frispark från vänster som Gurra skarvar vidare och Jonte kan nicka snyggt i mål. 2-0 låter vänta på sig en kvart ytterligare då Acke inte visar någon nåd mot sitt gamla lag utan gör en soloraid och målar snyggt.\nStort spelövertag av oss och massor av målchanser men 2-0 står sig halvleken ut.\n\nInför andra halvleken pratar vi om att snabba på spelet och passningarna, idag ska vi inte nöja oss med någon 3-1 seger inte! Tre minuter in i halvleken gör George 3-0 framspelad av Filip och Gurra. 4-0 minuten efter då Acke spelar fram kaparn… eum jag menar Ogge som äntligen får göra ett välförtjänt mål då han drar till med vänstern och skickar upp bollen i nättaket.\n5-0 minuten efter det då Jeppe och Leo kör en av våra intränade hörnvarianter och Jeppe säkert kan stänka in bollen (exakt hur det gick till är naturligtvis hemligt).\n6-0 i den åttonde minuten då Jeppe lägger en frispark strax utanför straffområdet direkt i mål.\n7-0 tre minuter senare då Leo drar ett inkast till Acke som målar säkert. 8-0 sju minuter senare då Jeppe spelar fram Leo som drar till med högern och skickar in bollen i nätmaskorna. 9-0 på en hörna fyra minuter senare då Filip trycker in returen. Minuten senare blir det 10-0 då Ogge spelar fram Acke som gör som han brukar, (dvs. mål!). Fyra minuter från slutet avslutar vi målskyttet då Rasmus skickar iväg en smörpass till Leo som fintar upp Enångersförsvaret på läktaren och lägger in bollen i bortre burgaveln.\n \nEn väl genomförd match av grabbarna, kul att vi kan bjuda på bra fotboll en hel match trots att vi är överlägsna. Ny nolla för Markus även om han inte behövde jobba ihjäl sig, tror han hade tre skott på sig under matchen. Men ändå kul med ett spel som börjar genom att målisen rullar ut bollen till backarna som sätter igång anfallen.\nStort beröm till samtliga grabbar för alla var riktigt bra i den här matchen, lite extra beröm får Filip Gerdin som gjorde sin första match i IIK-tröjan och dessutom direkt presenterade sig i målprotokollet, kul!\n\nÄNTLIGEN ÄR SOMMARUPPEHÅLLET ÖVER!!!\n\nMålen:\n1-0\tJonatan Sondell (4)\n2-0\tAxel Olsson (18)\n3-0\tGeorge Ibrahim (33)\n4-0\tOscar Jonsson (34)\n5-0\t Jesper Lindén (35)\n6-0\tJesper Lindén (38)\n7-0\tAxel Olsson (41)\n8-0\tLeo Eriksson (48)\n9-0\tFilip Gerdin (52)\n10-0\tAxel Olsson (53)\n11-0\tLeo Eriksson (56)\n\nVi som spelade:\nMålvakt: Markus\nBackar: Linus, Anders, Rasmus och Anti\nMittfält: George, Ogge, Jonte, Jeppe, Gustav och Leo\nForwards: Filip och Acke\n\n\n\n\n",
