    id: "95030b0c-60d1-4e6d-9902-be66bcdba4b7",
    title: "IIK Herr 1 - Näsviken",
    text: "Sparbanken Arena, Hudiksvall.\n\nIggarnas lag (4-4-2):\nAndreas Karlsson (46) - Henrik Ring, Fredrik Persson, Victor Hallberg, John Lärka - Andreas Midell, Micke Rask, Fredrik Broberg, Tony Eriksson - Johan Jacobsson, Mats Wennström\nAvb: Christer Ulander (46), Calle Jacobsson, Jakob Edström, Johnny Nordlund\n\nMålen:\n1-0 J.Jacobsson\n2-4 C.Jacobsson\n3-4 Wennström\n4-4 C.Jacobsson\n",
