    title: "Ljusdals IF - IIK Herrar",
    text: "Iggarna visade att de var det bättre laget och avancerad om till nästa omgång i DM där man kommer få möta Stugsund.\n\nSå startade IIK 4-4-2:\nChrister Ulander - Henrik Ring, Fredrik Westling, Fredrik Persson, Karl Ek - Martin Lööf, Fredrik Broberg, Mikael Rask, John Lärka - Johan Jacobsson, Mattias Samuelsson.\n\navb. Mikael Andersson, Niklas Nordström och Jakob Edström\n\n0-1 Mattias Samuelsson\n1-2 Mattias Samuelsson\n\nDagens plusare:\n+++ John Lärka\n++ Mattias Samuelsson\n+ Mikael Rask\n",
