    title: "Växbo - IIK Herr2",
    text: "En match där vi skulle haft minst oavgjort. Vi hade även en boll inne till 4-4 men den svartklädde lyckades få detta till offside.\n\nBra spel och positiv stämning matchen igenom av samtliga.\n\nPlussare:\n+++ Andreas Midell\n++ Kalle Ek\n+ Jimmy Qvist\n\nMålskyttar för Iggarna:\nAndreas Midell, Micke Andersson och Kalle Ek\n\nSå startade lag 2:\nChrister Ulander - Filp Westling, Simon Jonsson, Jimmy Qvist, Sebastian Schelin - Micke Andersson, Kalle Ek, Fredrik Forslin, Niklas Nordström - Johan Brygelsson, Andreas Midell\nErsättare: Surasak Saisaaen",
