    title: "Bergvik 2 - IIK Herr 2",
    text: "En match där vi helt enkelt var numret för litet och inte räckte till mot ett kraftfullt Bergvik.\n\nEn dålig första följdes av en något bättre andra. Vi var dock aldrig nära att komma ikapp trots reducering 3-1 i början av halvleken.\n\nEn match där vi helt enkelt var numret för litet och inte räckte till mot ett kraftfullt Bergvik.\n\nEn dålig första följdes av en något bättre andra. Vi var dock aldrig nära att komma ikapp trots reducering 3-1 i början av halvleken.\n\nStatistik:\n1-0 3' straff\n2-0 6'\n3-0 29'\n3-1 52' Johan Jacobsson straff\n4-1 53'\n5-1 69'\n\nDagens plussare:\n+++ Fredrik Persson\n++ Victor Hallberg\n+ Christer Ulander\n\nSå startade Iggarna:\nChrister Ulander - Simon Jonsson, Martin Lööf, Victor Hallberg, Kalle Ek - Niklas Nordström, Johan Jacobsson, Andreas Andersson, Sebastian Schelin - Micke Andersson, Johan Bryngelsson\nErsättare: Fredrik Persson, Pelle Skoglund, Omid Naqshbandi, Filip Westling",
