    title: "Färila IF - IIK Herrar",
    text: "Iggarna gjorde en riktigt bra första halvlek och hade bra kontroll på händelserna i Färila men några oturliga händelser bland annat en straff och ett självmål förstörde dagen för Iggesund och Färila kunde vinna med 3-0.\n\nSå startade IIK: (4-4-2)\nAndreas Karlsson - Jhonny Nordlund, Fredrik Persson, Fredrik Westling, Jakob Edström - Mattias Samuelsson, Carl Jacobsson, Fredrik Broberg, Mikael Andersson - Tony Eriksson, Andreas Midell.\navb. Niklas Nordström, Tommy Forslin, Simon Jonsson\n\nDagen plus:\n+++ Fredrik Westling\n++ Jakob Edström\n+ Carl Jacobsson",
