    title: "Näsvikens IK - IIK P93",
    text: "Stark insats av grabbarna som stod upp på ett utomordentligt sätt och kunde trors att man fick spela med en man mindre under stora delar av andra halvlek hålla ett tufft spelande Niken på stången.\nHinkvis med beröm till hela laget som såg till att bärga en riktigt skön trepoängare!\n\nSå startade P93: (4-4-2)\nWilhelm Groth - Oskar Axlund, Pontus Persson, Andreas Andersson, Emil Strömgren - Mohamed Darwiche, Emil Hallberg, Victor Hallberg, Omid Naqshbandi - Najem Seddiqi, Andreas Olsson\navb. Robin Larsson, Magnus Borin\n\nMålen:\n0-1 Najem Seddiqi\n0-2 Pontus Persson\n1-3 Robin Larsson",
