    id: "9be77276-260d-4086-9402-6adf0b025b8d",
    title: "IIK F16 - IIK P13",
    text: "Träningsmatch 11-manna.\n(2*35min)\n\nTotalt bara andra matchen på 11-manna och visst var det lite nervöst innan domare Andersson blåste till avspark.\nGrabbarna öppnar mycket bra och har ett lysande anfallsspel som inom loppet av endast några minuter resulterar i fyra heta målchanser varav åtminstone två jag var helt säker på att bollen satt i mål. Det dröjer dock 12 minuter in i matchen innan vi kan göra vårt första mål då Ahmed sätter bollen efter ett fint anfall. 2-0 kommer endast två minuter senare då Linus slår ett inlägg från vänsterkanten som Jeppe skjuter på och Acke petar in returen. 3-0 kommer 23 minuter in i halvleken då Acke spelar fram bollen till Jonte som kyligt loppar bollen över målvakten och in i mål. Med minuten kvar av halvleken gör vi 4-0 då Leo spelar fram bollen till Olivier som i sin tur hittar Ahmed som målar.\nEn mycket bra första halvlek av oss då vi radar upp fina anfall och inte släpper till en enda målchans bakåt.\nAndra halvlek hinner bara bli tre minuter gammal innan vi åter hittar målet, denna gången efter ett anfall längs vänsterkanten som börjar på backplats då Emil P spelar fram bollen till Linus som hittar Emil H i djupled som kan dra sig ner mot kortlinjen och spela bollen in till en fri Ahmed som bara har att peta in bollen. 6-0 görs slutligen med fem minuter kvar av matchen då Olivier spelar fram Jeppe som skjuter och returen rensas in i eget mål.\n\nFörsta halvlek är riktigt bra och den ska vi känna oss nöjd med, andra halvlek är något sämre då vi har en period i mitten på halvleken som vi tappar bollen och hamnar lite fel i positionerna. Detta beror dels på att vi blir lite trötta men också på att vi leder klart och slappnar av.\nI det stora hela en bra match som vi kontrollerar fullt ut. Vi spelade runt bollen bra och fick med oss backlinjen upp bra i anfallen vilket skapade ett extra tryck.\nVi har lite att jobba med i tempo och passningar tills motståndet blir tuffare men vi ska absolut vara nöjda med denna match.\n\nMålen:\n1-0 Ahmed Rashid (12)\n2-0 Axel Olsson (14)\n3-0 Jonatan Sondell (23)\n4-0 Ahmed Rashid (34)\n5-0 Ahmed Rasid (38)\n6-0 Jesper Lindén (65)\n\nVi som spelade:\n(4-4-2)\nMackan – Pettersson, Rasmus, Anders, Anti – Linus, Olli, Emil, Leo – Acke, Ahmed.\nAvbytare: Jonte, Jeppe, Dennis, Filip, Karar.\n\nDomare: Andreas Andersson – hade det ganska lugnt.\n\n",
