    text: "En skön trea i preimären som blev onödigt spännande.\nUnder den första halvleken gör vi en godkänd insats och tar relativt komprotabelt med oss 4-1 in i paus. Våra ord i halvtid är att gå ut och spelmässigt göra en bättre andra del av matchen. Det gör vi inte riktigt. Lite stress och lite slarv samtidigt som Ljusdal kommer ut hungrigare efter vilan gör det som sagt onödigt spännande. Men summa sumarum så räknar vi in tre sköna poäng och vinner premiär trots att vi inte kommer upp till vår normala nivå och spelar den fotboll vi kan.\n\nMålen: Elin B, Mia och Carro x 2.\n",
