    title: "Trönö IK - IIK Dam",
    text: "Ny trea efter en fantastiskt fin fotbollskväll.\nEn väl godkänd match av alla tjejer där vi från sidan kan känna oss relativt lugna matchen igenom. Vi gör några förändringar i andra då vi bland annat neutraliserar deras defensiva mittfält vilket gör att vi låser deras försök till uppbyggnad effektivt. Dock en eloge till Trönö för att dem försöker mestadels rulla boll och har även ett par halvchanser som skulle, med hjälp av den låga vårsolen, kunna ställa till det men inte denna kväll.\nSom sagt en härlig fotbollskväll med bra väder, en trevlig match och en ny trea. I och med den gick vi även, i en haltande tabell, upp som serieledare med tjejerna.\n\nMålen: Tine, Carro B",
