    id: "afa98d81-58fe-428f-b6b8-22cb5480d843",
    title: "IIK Herr 2 - Högs SK 2",
    text: "En riktigt enkel seger för lag två där man visade prov på ett passningsspel och en offensiv vilja som nästan gjorde att man kände sig överflödig på sidan. Och hade vi haft lite bättre fokus i avsluten hade vi haft åtminstone 4-0 med oss i halvtid, men vi fick nöja oss med ett efter att korthörnan till Kalle äntligen givit utdelning.\n\nDessförinnan hade vi hunnit med och skjutit mitt på målvakten haft en boll dansande på mållinjen tvingat sagd målvakt till en par jätteräddningar.\nVi följde matchplanen perfekt och höll ett högt boll tempo och utnyttjade det faktum att de inte satte oss under speciellt stor press och kombinerade oss fram på ett fantastiskt sätt.\nMen alla chanser till trots så fick vi nöja oss med 1-0 i halvtid. \n\nI andra så satte de något högre press på oss men det till trots fortsatte vi att prestera bra fotboll och bara en minut in på halvleken så slår Lärka ett inspel från vänster riktat mot Ante men varken Ante eller försvarare hinner fram och bollen går rakt i mål.\nVi fortsätter att inneha initiativet i matchen och när timmen är spelad kommer vi fram i ett väldigt fint anfall igen och det hela slutar med att Kalle friställer Simon som inte gör något misstag och stänker dit 3-0\n\nTio minuter senare så slappnar vi av lite och när Hög vinner en 50/50 boll så får de en spelare helt fri inne i straffområdet som Per kommer som skjuten ur en kanon mot men misstajmar brytningen och straffen är ett faktum och förvaltas sen på ett säkert sätt till 3-1\n\nResten av matchen behåller vi bollen bra inom laget och spelar oss fram till några hyfsade chanser men inte förrän i de sista minuterna så får vi ytterligare utdelning på straff efter att Midell tagit sig igenom hela Högförsvaret och Olof sedan lika säkert som vanligt slagit in straffen.\n\nPlusen idag blir väldigt svåra att dela ut då jag skulle vilja ge tre till HELA laget, Verkligen en gedigen insats från Ulander i målet till Nocke med allt runt om.\n\nLaget:(4-4-2)\nChrister Ulander - Jimmy Kvist, Fredrik Persson, Per Hedlund, Jakob Edström - Simon Jonsson, Hannes Sundkvist, Karl Ek, Emil Hallberg - Andreas Olsson, Andreas Midell\navb. Olof Westling, John Lärka, Dennis Baban\n\nMålen:\n1-0 Karl Ek (Andreas Midell)\n2-0 John Lärka\n3-0 Simon Jonsson (Karl Ek)\n3-1 straff\n4-1 Olof Westling (str)\n\nDagens plus:\n+++ Karl Ek (Mål framspelning och sista matchen i IIK för säsongen)\n++ Fredrik Persson (Sprider lugn och bidrar mycket även offensivt)\n+ Simon Jonsson (Stabil bakåt och lurig framåt)\n+ Hannes Sundkvist (Energiknippet nr.1 som nu verkligen bemästrar sin defensiva mittfältsroll)",
