    title: "IIK Herr - Nordanstigs FF",
    text: "Hej och välkommna till dagens match fär Iggarna ska ta sig an Nordanstigs FF. En jämn vårmatch spelmässigt var det, resultatet dock 3-0 till Iggarna den gången.\n\nIggarna mönstrar följande startuppställning ikväll:\nThomas Ludwichowski - Olof Westling, Johan Jacobsson, Victor Hallberg, Martin Lööf - Niklas Nordström, Fredrik Westling, Mikael Thuresson, Tony Eriksson - Mats Wennström, Tommy Forslin\n\nPå bänken: Hannes Sundqvist, Jakob Edström, Simon Jonsson, Fredrik Forslin, Andreas Olsson\n\nI kiosken: Johnny Nordlund, Andreas Midell och Mattias Samuelsson.\n\nMicke Thuresson från start alltså ikväll och det ska bli intressant att se vad han kan uträtta på mitten. \n\n18.30 Så var vi igång. Nordanstig hade avspark.\n\n15 min. Igen profil på matchen så här långt. Lagen känner på varandra. Nordanstig har haft bollen mest.\n\n35 min. Väldigt tafatt från hemmalaget så här långt. Nordanstig hotade med ett friläge alldeles nyss som dock sköts över. Nu hade Iggarna en kombination som avslutades med att Niklas sköt i burgaveln.\n\n45 min. Paus. Om ni undrar varför jag inte skrivit så mycket så är det därför att det inte funnitsså mycket att skriva hem om. Iggarna har dock kommit upp i plan sista 10 men den sista passningen har slagits bort alltför enkelt.\n\nNu får vi hoppas på bot och bättring till den andra halvleken.\n\n60 min. Lite bättre från IIK nu. Nyss en bra räddning av Ludde till hörna. Kom igen nu!\n\n62 min. MÅÅÅÅÅÅLL! 1-0 genom Tommy, efter en gradios passning från Micke Thuresson lyfter Tommy behärskat över målvakten. Mycket snyggt!\n\n65 min. MÅÅÅÅÅÅLL! 2-0 genom Big Mats, dagens födelsedagsbarn dessutom. Först skott från Tony, retur som Niklas skjuter och mv stoppar men får inte fatt i bollen varvid Mats dunkar in den i mål från en centimeter.\n\n69 min. MÅÅÅÅÅÅLL!! 3-0 genom Johan Jacobsson på straff efter att Big Mats rivits ned i straffområdet.\n\n72 min. Varning Nordanstig nr 5 Ricardo Taja.\n\n80 min. Mål. Reducering 3-1 genom nr 18 Morgan Johansson. Ett skott utifrån som han säkert är rätt nöjd med. Jobba sista nu Iggarna!\n\nTony och Mats har gått ut. Andreas Olsson och Simon Jonsson har ersatt.\n\n86 min. Seriedebut för Hannes när han byter med Thuresson. Iggarna har mattas av efter rycket nu och försöker spela av matchen. NFF sticker upp och oroar. 3-2 skulle inte vara kul inför slutet.\n\nEn rättning angående NFF:s målskytt. Nr 19 Gunnar Hägg ska det vara.\n\n90 min. Slut! Iggarna höll undan fint i slutet och kunde bärga tre friska pinnar.\n\nÅterkommer med kommentar från Kåge-Petter och spelarbetyg.\n\n- En första halvlek där vi inte alls kommer till och Nordanstig tilläts ha mycket boll utan att skapa särskit mycket, sa Kåge.\n\n- Till andra ändrade vi genom att Tony flyttade upp på topp och Tommy ut på kanten och det gav fin utdelning nästan direkt.\n\nKåge tyckte att det var kul att se Micke Thuresson som hade en bortslagen passning under matchen och framförallt Niklas Nordström som lagt till epitet grovjobbare på visitkortet numera.\n\nKåge ville även framhålla Johan och det vill även vi i redaktionen göra men även dra en lans för hans mittbackspartner Victor idag. Tillsammans presterade de en i närmaste perfekt match understödda av Martin och Olof på kanterna.\n\nEtt tack till dagens bollkallar från PF-01 som skötte sig utmärkt och till grabbarna i kiosken som skötte sig med bravur.\n\nNästa match är Rengsjö borta på söndag.\n\nDagens plussare:\n+++ Niklas Nordström\n ++ Mikael Thuresson\n + Johan Jacobsson & Victor Hallberg",
