    id: "e0ba831c-51cb-4a15-a857-eb57b45cbfab",
    title: "IIK Herr 2 - Bjuråkers GIF 2",
    text: "En mycket bra genomförd match av lag 2 med stort fokus och riktig spelglädje.\n\nEn eloge till Bjuråker som verkligen försökte bjuda upp till match och aldrig deppade ihop och därmed bidrog till att detta blev en välspelad tillställning.\n\nIggarna var dock nummret större i det mesta och kontrollerade matchen störr delen av tiden. Kul som sagt att se det fokus som samtliga spelare visade från första minuten till sista. Lätt att man slappnar av med så stor ledning men killarna höll stilen hela vägen ikväll.\n\n\nAlla ska stort beröm i hemmalaget där för kvällen ute spelaren Anton hängde två baljor varav en på nick(!). Fredrik Broberg gjorde comeback och gjorde det bra tillsammans med Hannes på mitten.\nBacklinjen var solid med Persson som stabil ledare och framåt var Midell och Olsson hela tiden på språng. Bra inhopp av Dennis Baban som även blev målskytt, vi hoppas få se mer av honom i fortsättningen.\n\nEn kille som gjorde sin sista match för IIK på ett tag var Jakob Edström som flyttar till Göteborg på söndag. Jacke krönte säsongen med att dunka in 3-0 på straff och med en gedigen insats i övrigt. Killar som Jacke växer inte på träd, alltid lojal och inget gnäll trots lite speltid i förstalaget ibland och alltid bra i lag 2. Dessutom en helyllekille som är uppskattad bland killarna. Lycka till Jacke, vi hoppas få se dig igen i den vitblå tröjan i framtiden! \n\nDagens plussare:\n+++ Fredrik Persson\n ++ Simon Jonsson\n + Fredrik Broberg, Jakob Edström\n\nSå startade Iggarna:\nChrister Ulander - Simon Jonsson, Fredrik Persson, Jimmy Qvist, Jakob Edström - John Lärka, Hannes Sundqvist, Fredrik Broberg, Emil Hallberg - Andreas Midell, Andreas Olsson\n\nErsättare: Dennis Baban, Fredrik Forslin, Andreas Karlsson.\n\n1-0 15 Andreas Midell\n2-0 23 Fredrik Persson\n3-0 35 Jakob Edström\n3-1 59\n4-1 67 Andreas Karlsson\n5-1 68 Dennis Baban\n6-1 70 Andreas Karlsson\n7-1 76 Simon Jonsson\n8-1 82 Andreas Midell \n",
