    id: "f624c1a3-143c-4ccc-a88c-f20d6f3b0396",
    title: "Iggesunds IK - Bollnäs GIF FF",
    text: "Iggarna hade inget att hämta mot pånyttfödda Bollnäs GIF FF på lördagen. 0-2 och Iggarna var aldrig när poäng i matchen. \nDet syns att det riktiga självförtroendet saknas framförallt i det offensiva spelet. Iggarnas attacker styrdes enkelt undan av ett stabilt Bollnäsförsvar.\n\nBakåt gör man dock en ok insats och lyckas avstyra många Bollnäsanfall och de som slank igenom tog Ludde hand om på bästa sätt.\nTyvärr är det en riktig groda som skapar 0-1 efter 16 minuter och även 0-2 hade man kunnit undvika när man tappade boll onödigt på offensiv planhalva vid egen frispark.\n \nMen Bollnäs vann rättvist och en poäng i den här matchen hade varit en stor bonus för hemmalaget. Efter Bollnäs andra mål så kom matchen att mest likna en avslagen Trocadero.\n\n+++ Thomas Ludwishowski\n ++ Marcus Larsson \n + Daniel Wester\n\n<b>Laget</b>\nThomas Ludwishowski - Per Hedlund, Martin Lööf, Johan Jacobsson, Victor Hallberg - Olof Westling, Marcus Larsson, Daniel Wester, Fredrik Westling, Mattias Samuelsson, Dennis Baban\n\n<b>Ersättare</b>\nMikael Andersson, Emil Hallberg, Andreas Midell, Jacob Edström, Andreas Olsson\n",
