    text: "En mycket bra genomförd match från vår sida. \n\nFörsta halvlek är vi i princip 100% i allt vi kommit överens om innan. Och vi kröner insatsen med ett vackert anfall med en spelvändning av Johan Näsman och några snabba passningar mellan Axel, Olle och Jonatan som friställde Achmed som sätter dit bollen.\n\nAndra halvlek tröttnar vi lite i positionsspelet men vi fortsätter att spela bra anfallsfotboll och gör till slut även 2-0 genom Jesper som löper igenom på Olivers fina passning. Bakåt blev det lite oroligt efter deras reducering men Gustav i målet kom ut stort i slutminuterna och genom några fina räddningar såg han till att poängen stannade på Movallen.\n\nStort beröm till samtliga ikväll för en mycket bra insats.\n\nLaget:\nGustav - Måns, Emil, Anton, Olle - Leo, Johan, Oliver, Axel - Jesper, Jonatan, Achmed",
