    title: "Ilsbo SK - IIK P97",
    text: "En väl genomförd match från vår sida där vi periodvis spelar riktigt bra fotboll.\n\nEnda negativa idag var avsluten. Vi bränner ett 10-tal öppna lägen och dessutom på det två straffar. \n\nSpelmässigt dock inte mycket att klaga på. Vi släpper boll och visar tålamod i anfallsspelet och vi fyller på framåt på ett bra sätt.\n\nBra jobbat grabbar! Nu vilar vi fram till söndag då vi tränar kl 18.00 på Movallen.\n\n<b>Laget</b>\nGustav - Viktor, Emil, Anton, Olle, Leo Jack, Johan, Axel, Jesper, Marcus, Emil",
