    id: "75a5008c-b1f0-4378-b027-ca0eca80986e",
    title: "IIK P15 - Bergsjö",
    text: "Träningsmatch, grus\n\nDags för årets andra träningsmatch, betydligt tuffare motstånd väntade nu i form av Bergsjö.\nVi väljer att testa en ny 4-5-1 uppställning i matchen för att försöka få ett övertag på mittfältet.\n\nEn ganska jämn första halvlek där Igge står för det mesta bollinnehavet. Dock så har gästerna ett kompakt försvar samtidigt som de oroar med mycket folk i anfallet. Iggarna skapar första halvlekens hetaste chanser och kan även gå till pausvila med en 2-0 ledning. 1-0 går vi tolv minuter in då Hallberg lägger en frispark från höger nästan nere vid kortlinjen utanför straffområdet. Olivier är först på bollen strax innanför straffområdet och lyfter den över målvakt och in i mål. 2-0 kommer sju minuter senare då Strömgren lägger en lång frispark från egen planhalva mot Ahmed som kan dra ifrån markeringen och sätta bollen säkert i mål. \nFörsta halvleken går lite i vågor där vi blandar mycket fina anfall med lite sämre prestationer vi står dock för det mesta av spelet och Bergsjö hindras från att skapa de riktigt heta chanserna. Fullt fokus vill vi ha inför andra halvlek nu, vi leder bara med 2-0 och kan inte slappna av som vi gjorde mot Forsa. Vi väljer även att starta med 4-4-2 i andra halvleken.\nAndra halvlek öppnar vi riktigt bra och de första 5-10 minuterna är det bara Iggesund för hela slanten, vi borde även här ha punkterat matchen på någon av alla de chanser vi skapar. Bergsjö sätter in en till kille på mitten vilket gör att vi tappar vårt mittfält och därmed även initiativet i matchen. Bergsjö anfaller nu flitigt medans vi får inrikta oss på att drilla försvarsspelet, dock så får inte Bergsjö till några riktigt heta lägen då vi har väggen Wille i målet och Hälsinglands snabbaste mittback i Strömgren. De farligaste lägena som Bergsjö skapar är två frisparkar som dimper ner vid andrastolpen där vi tappat markering. Vi väljer nu att återgå till 4-5-1 får att återta mittfältet och sätter in Jeppe i en mittmittroll, det är också Jeppe som kort därefter kan sätta 3-0 då Hallberg spelar fram honom på gränsen till straffområdet och Jeppe tester det mest underskattade av alla skott, tåpajen. Skottet sitter otagbart för Bergsjös målvakt och 3-0 är ett faktum. De återstående minuterna fortsätter vi att spela bra fotboll emellanåt och vaskar även fram några chanser utan att få utdelning så 3-0 blir även slutresultat.\n\nEn bra genomkörare mot ett kompakt och fysiskt Bergsjö. En betydligt bättre värdemätare än första matchen. Vi har fortfarande en hel del kvar att jobba med men vi ser att intentionerna finns där och vi har kapaciteten att spela mycket bra fotboll.\nAlla spelare gör en bra match där Strömgren utmärker sig i mittförsvaret samt Hallberg och Wiklund på mittfältet. Dagens extraplus till Marcus Westby som gör sin första match i IIK-tröjan och gör en bra insats och kommer bli ännu bättre med några fler träningar och matcher i benen.\nBra insats grabbar, nu fortsätter vi ösa på på träningar och matcher.\n\nMålen:\n1-0\tOlivier Lindh (12)\n2-0\tAhmed Rashid (19)\n3-0\tJesper Lindén (71)\n\nVi som spelade: (4-5-1)\nWille – Linus, Anti, Strömgren, Rasmus – Marcus, Olli, Hallberg, Jeppsson, Wiklund – Ahmed.\nAvbytare: Samel, Agahan, Leo\n\nDomare: Per Hedlund, bra",
