    id: "58295075-47ed-4829-820e-8c4d8d8f3bd8",
    title: "IIK P15 - Bergsjö",
    text: "Seriepremiär\n\nÄntligen dags för seriepremiär och Movallens A-plan var i suveränt skick. \n\nFör motståndet denna dag stod Bergsjö, ett lag som vi av tradition har svårt med. Försnacket gick därför mycket ut på vikten av rätt inställning. Det kändes som snacket lönade sig för när domare Vestling blåser igång matchen så är det Iggarna som tar kommandot och inledningsvis starkt pressar tillbaka Bergsjö på egen planhalva. Dock så låter ledningsmålet vänta på sig till minut 17 då Wille läser spelet bra och är tidigt ute och bryter, bollen går till Samel som rinner igenom och placerar in bollen. 2-0 kommer även det innan halvtid efter att Olivier lagt en snäv högerhörna som Hallberg nickar in i öppet mål. \nVi snackar i halvtid återigen om inställning vi måste ha tålamod i vårt spel och spela efter vår egen spelidé. Vi måste även skärpa till oss på mittfältet där vi blev alldeles för passiv halvägs in i halvleken och lät Bergsjö både ta emot och vända upp med boll innan vi var där. \nAndra halvlek öppnar vi liksom den första riktigt bra och pressar tillbaka Bergsjö starkt, när sedan Bergsjö rinner igenom och kan reducera 12 minuter in i andra så blir vi ängsliga och tappar tålamodet i vår speluppbyggnad. Bollarna ut på kanterna ersätt i stället med långa bollar i djupled och vi blir väldigt lättlästa i anfallen. Olivier kliver i det läget fram och visar vilja när han tar med sig bollen ner till kortlinjen där han passar snett inåt bakåt där dyker en sträckt vrist upp och sätter bollen snyggt i bortre krysset… visst det var en vrist tillhörande en Bergsjöspelare men alla mål räknas. Vi kan även sätta spiken med åtta minuter kvar då Hedblom vinner boll på mittfält och slår den i djupet till Samel som sätter den.\n\nSkönt med tre poäng i premiären. Vi spelade stundtals bra men sett till hela matchen så var det absolut ingen av våra bättre insatser i år. Vi måste arbeta på att ha tålamod i vårt spel, vi vet att vi har en vinnande spelidé och även fast målen dröjer så måste vi fortsätta spela efter vår plan och vår spelidé. Vi gjorde vad som behövdes i den här matchen, inte mer. Vi vet att det väntar tuffare motstånd och det krävs då att vi kan ta vårt spel till en högre nivå, det vet vi att vi kan för det har vi visat i flera träningsmatcher i år.\n\nSammanfattningsvis så kan vi konstatera att det var en skön seger och en godkänd insats. Ingen höjde sig över mängden denna match utan det var en kollektiv insats. Kul var att Robin Larsson var tillbaka i IIK-tröjan och gjorde säsongsdebut, tyvärr gjorde känningar i ryggen på uppvärmningen att han inte kunde spela, vi ser fram emot att få se Robin i nästa match istället.\n\nMålen:\n1-0 Christoffer Samuelsson (17)\n2-0 Emil Hallberg (23)\n3-1 Olivier Lindh (64) (o.g.)\n4-1 Christoffer Samuelsson (72)\n\nVi som spelade: (4-5-1)\nWille – Marcus, Elving, Strömgren, Linus – Agahan, Hedblom, Olli, Hallberg, Wiklund – Samel\nAvbytare: Achmed, Acke\n\nDomare: Lasse Vestling, utmärkt\n",
    score: "4-1",
    date: "2010-05-12",
    team: "7d45e6c5-e581-4547-91bc-b98653198087",
    author: "fdddbd31-babb-45ab-b8bc-8026b3bb9bc7",
