    title: "Ljusdals IF - IIK Herr",
    text: "Det har fallit bort några referat. Nu kommer komplement åtminstone för att få ordning i plus ligan.\n\nDen här matchen i sig finns det egentligen inget att skriva om annan än att det var förbannat synd om Patrik.\n\nLaget: (4-4-2)\nPatrik Åslin - Jakob Edström, Per-Johan Westrin, Victor Hallberg, Olof Westling - Emil Hallberg, Fredrik Westling, Daniel Wester, Mikael Andersson - Andreas Midell, Dennis Baban\navb. Martin Enström, Olli Luoto, Olivier Lindh, Erik Hallqvist\n\nDagens plus:\n+++ Patrik Åslin\n++ Daniel Wester\n+ Per-Johan Westrin",
