    title: "Iggesunds IK - Enångers IK",
    text: "Iggarna drog längsta strået i kvällens träningsmatch mot EIK. Emil Hallberg satte 1-0 i matchens näst sista spark. En jämn och kampfylld match där oavgjort länge såg ut att bli det rättvisa slutresultatet men Iggarna lyckades forcera in en vinstboll på övertid.\n\nViktor Persson i tillbaka målet svarade för en stabil insats tillsammans med övriga i försvaret.",
