    text: "Träningsmatch, spelades på Glysis. 0-2 i paus.\n\nIggarnas målskyttar: Becir Camo och Mattias Samuelsson.\n\nSå startade Iggarna:\nViktor Persson - Björn Jonsson, Haris Camo, Fredrik Forslin, Victir Hallberg - Niklas Nordström, Tobias Björk, Emil Hallberg, Mattias Samuelsson - Tommy Forslin, Becir Camo\n\nErsättare: Dennis Baban, Erik Hallkvist\n\nDomare: Bo Camél, mycket bra i sin comeback!\n",
