    id: "38ff1bb2-1244-4925-b5a0-44dcde6bccd6",
    title: "Iggesunds IK - Nordanstigs FF",
    text: "Träningsmatch, spelades på Glysis.\n\nEn match där Iggarna blandade och gav ordentligt. Strålade offensivt spel stundtals där man inte lånade ut bollen till Nordanstig följt av ett otroligt taffligt försvarsagerande när NFF tilläts sticka upp.\n\nLjuspunkterna fanns i det offensiva spelet där 4-1 målet föregicks av 18 eller 19 pass i rad innan Niklas satte bollen i nät. Det tar vi med oss till nästa helg då årets första tävlingsmatch väntar, Bollnäs på Glysis söndag 17.00.\n\nLäs även Jonas analys från matchen i coachbloggen.\n\nMålen IIK: Daniel Wester 2, Haris Camo, Mattias Samuelsson, Niklas Nordström\n\nSå startade Iggarna:\nPatrik Åslin - Björn Jonsson, Fredrik Forslin, Glenn Sjögren, Victor Hallberg- Fredrik Westling, Haris Camo, Emil Hallberg - Niklas Nordström, Daniel Wester, Mattias Samuelsson\n\nErsättare: Oliver Lindh, Mattias Samuelsson, Erik Hallqvist, Viktor Jansson, Becir Camo",
