    title: "Iggesunds IK - IFK Bergvik",
    text: "Träningsmatch som spelades på Glysis.\n\nMålskyttar, Daniel Wester 2, Dennis Baban och ett självmål.\n\nLäs analys från Jonas i Coachbloggen.\n\nSå startade Iggarna:\nViktor Persson - Olle Westling, Haris Camo, Fredrik Westling, Victor Hallberg - Erik Sundman, Emil Hallberg, Oliver Lindh - Tobias Björk, Daniel Wester, Becir Camo\n\nErsättare: Olli Luoto, Dennis Baban, Björn Jonsson",
