    id: "f4ba60c9-d8fd-41c5-a70f-6202411e1f51",
    title: "Edsbyns IF FF 2 - EIK/IIK Dam",
    text: "Tyvärr ingen referent på plats för att bevittna damernas match mot Edsbyn.\nMen de på plats rapporterade om en kanoninsats.\nSäsongens bästa till och med.\n\nLaget: (4-2-3-1)\nEvelina Fredin - Julia Andersson, Sofia Frisk, Stina Sandström, Erika Strandell - Elin Tegenfeldt, Madeleine Zetterlund - Isabel Brink, Tine Eriksson, Johanna Ohlsson - Linnea Persson\n\navb. Lina Settlin, Angelica Tagg, Cajsa Vedin\n\nMatchens plus:\n+++ Tine Eriksson\n++ Linnea Persson\n+ Elin Tegenfeldt, Madeleine Zetterlund\n\n<A HREF=http://halsingland.svenskfotboll.se/resultat-tabeller/?scr=result&fmid=2006958>Matchfakta</A>",
