    id: "23b35486-9a45-45c2-be3a-61cc1d4ded01",
    title: "EIK/IIK Dam - Wallvik",
    text: "Trots att målen uteblev denna gång svarar EIK/IIK damerna återigen för en mycket bra spelmässig insats. Faktum är att Wallvik endast tvingade EIK/IIK:s målvakter (Tine stod andra halvlek efter en sträckning på Evelina)till två räddningar på hela matchen. Anfallsmässigt finns inte heller något att klaga på, förutom uteblivna mål. EIK/IIK skapade chans på chans hela matchen men den rätta skärpan saknades. Damernas, för säsongen, nya spelsätt (vill inte kalla det spelsystem) funkar bättre och bättre. Det som glädjer mest, förutom det radikalt förbättrade passningsspelet, är ytterbackarnas löpvillighet och vilja att deltaga i anfallen. Om man får önska, och det får man ju,så skulle lite mer aggressivitet från alla spelare inte sitta fel. Nästa helg träningsspelar laget igen, denna gång mot Team Hudik 2 innan de genrepar mot Team Hudik A helgen därefter. Två matcher mot lite hårdare motstånd innan seriepremiären mot Bergsjö 4 maj.\nLaget: (4-2-3-1) Evelina Fredin - Julia Andersson, Sofia Frisk,Stina Sandström,Erika Strandell - Elin Tegenfeldt,Linnea Åkerlund - Johanna Ohlsson,Cajsa Vedin,Isabel Brink - Madde Zetterlund - Linnea Persson,Frida Borin,Erika Frisk,Tine Eriksson",
