    id: "efa4216b-121c-44b1-9eba-615562e443b1",
    title: "IIK Dam - Njutångers IF",
    text: "Iggarna var starkare i ett derby som innehöll mer kamp än skönspel och verkligen hade en typisk derbykaraktär.\n\nHemmalaget fick en smakstart på matchen då Isabel Brink får bollen av Matilda strax utanför Njutångers straffområde och med en fin passning hittar hon Linnea Persson inne i detsamma. Hon i sin tur tar sig förbi en försvarare och trycker in 1-0 redan efter tre minuters spel.\nOch kanske förväntade man sig då att saker och ting skulle flyta på lika bra som det gjort mot Norrala och Bollnäs för kvalitén i spelet föll markant. Mycket kamp och bolltapp präglade matchen och inget av lagen kunde etablera något vägvinnande anfallsspel. \nDen kampfyllda matchbilden verkade gynna Njutånger allra mest då deras mer direkta spel blev minst lidande av bristen på ordnat spel.\nMen några direkta målchanser skapade inte något av lagen utan allt som oftast tog det stopp utanför respektive straffområde. \nEfter dryga halvtimmen slår Njutånger en lång boll ner mot Iggarnas vänsterkant dit en anfallare löpt ut och slår ett inlägg som studsar än hit och än dit innan en NIF-spelare får träff och trycker in kvitteringen.\nHalvleken fortsätter sedan på samma sätt, mycket kamp och väldigt lite skönspel och få chanser värda att kalla heta. Så 1-1 stod sig till vilan.\n\nAndra halvlek är ett stort fall framåt jämfört med den första för Iggarna då man flera gånger fick till riktiga anfalla och kombinationerna började sitta mycket bättre.\nKvalitetshöjningen gjorde att man tog kommandot i matchen och tryckte tillbaka Njutånger mer och mer. NIF kändes dock aldrig ofarliga då deras långa bollar upp mot de kvicka och tekniska anfallarna ställde IIK-försvaret på prov.\nMen Iggesud står emot bra och kan skapa chanser framåt, Linnea Åkerlund hittar Isabel Brink i djupled och hon rundar målvakten men kommer ur läge och spelar istället in mot Johanna Ohlsson som tyvärr väljer att ta emot bollen snarare än att avsluta på ett och en njutångersförsvarare hinner emellan och kan täcka hennes skott. Iggarna fortsatte att trycka på för ett ledningsmål samtidigt som Njutånger började kännas tröttkörda och deras anfall blev väldigt korta.\nStunden senare var det dags igen. Linnea Persson möter bollen och sätter sedan ner den bakom backlinjen till Isabel Brink som återigen kan spela förbi målvakten till Johanna Ohlsson som denna gång får se sitt avslut rensas undan alldeles innan mållinjen.\nIstället kommer ledningsmålet ur en situation som egentligen inte är en målchans. Angelica Tagg får bollen en bit in på offensiv planhalva och slår ett inlägg som hamnar för nära mål men målvakten klarar inte av att hålla den och retfullt men glädjande för hemmalaget ramlar den ned bakom henne och in i mål.\nNjutånger som har haft det tufft hittills i den andra halvleken har svårt att iscensätta en jakt på kvittering och Iggesund kan fortsätta att hålla rätt bra kontroll på händelserna. Först med fem minuter kvar lyckas Njutånger etablera press och skapar några halvchanser men Evelina Fredin agerar säkert i målet och avvärjer de anfallsförsök som leder fram till avslut och Iggarna kan hålla undan till en mycket skön derbyvinst.\n\nSett till hela matchen är det en rättvis seger då hemmalaget både stod för de flesta och bästa målchanserna samtidigt som man understött av en solid försvarsinsats hade rätt bra kontroll på spelet i den andra halvleken samtidigt som man vet att det finns mycket mer att hämta från det här laget.\n\nLaget: (4-4-2)\nEvelina Fredin – Angelica Tagg, Julia Andersson, Elin Tegenfeldt, Fanny Westman – Matilda Brink, Linnea Åkerlund, Emma Trönnhagen, Johanna Ohlsson – Isabel Brink, Linnea Persson\n\nAvb. Cajsa Vedin, Frida Borin, Ida Tilemo, Elin Lindqvist\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2662806>Matchfakta</A>",
