    id: "a423fa1e-c978-4872-a353-a8796c5fcdad",
    title: "Norrala IF - IIK Herr",
    text: "Trist avslutning på en annars väldigt trevlig vår för Iggarna då man fick vända hem från Borgs IP med 0-0 mot bottenlaget Norrala.\n\nIggesund var det lag som hade mest boll men hade svårt att skapa målchanser av spelövertaget och det som varit lite signifikativt för säsongen hittills är ju bristen på chanser och effektiviteten då chanserna faktiskt dyker upp.\nIggarna fick den beskrivningen till trots en tidig chans då Fredrik Rahm slår en hörna som Sundman nickar strax utanför stolpen. \tOch efter en rätt pigg inledning då det kändes som att det var ett revanschsuget IIK lyckades Norrala äta sig in i matchen mer och mer och den fick en rätt jämn karaktär även om det var gästerna som hade det mesta bollinnehavet. Efter en lång period där inget av lagen egentligen var nära att oroa varandras försvar blixtrar Iggarna till. Dennis Backström gör det riktigt bra och kommer fram på vänsterkanten innan han hittar in med en passning i straffområdet ner mot kortlinjen till Wester som i sin tur hittar en ensamstående Samuelsson strax bakom straffpunkten. Samuelsson drar till direkt med vänstern men får retsamt se sitt avslut nickas undan på mållinjen av en vaken försvarare.\nNästa vassa läge tillföll Norrala efter en snabb omställning på IIK:s vänsterkant hittar de in till en anfallare som klipper till direkt och avslutet är riktigt bra men reflexräddningen från Mathias Svärd är ännu bättre och nollan hålls intakt.\nMatchen fortsätter på samma sätt, Norrala prioriterar att vara på rätt sida boll medan Iggarna har svårt att skapa något av sitt spelövertag så halvleken slutar mållös.\n\nI den andra rivstartar Norrala och lyckas skapa två halvchanser på kort tid men vid båda tillfällena agerar Svärd vaket och kan avvärja innan det hann bli farligt på riktigt. Iggarna hade också en hyfsad chans i inledningen av den andra halvleken då Mattias Samuelsson hittar Wester utanför straffområdet som skjuter ett skott strax utanför stolpen.\nAllt för ofta tog man sig enkelt fram till Norralas straffområde för att sedan ha problem med dem avgörande kombinationerna som inte satt som de skulle. Viktor Jansson stod för ett piggt inhopp och var nära att hitta pannan på Emil Hallberg som kom inlöpande från vänsterkanten men marginalerna var på Norralas sida. \nMitt i en bra period från Iggesund så sticker Norrala upp i en vass kontring där man inte alls hänger med i den defensiva omställningen och det är inte långt ifrån att hemmalaget kan ta ledningen efter vinande skott som strök överliggaren.\nDesto längre matchen led blev det tydligt att Norrala var nöjda med en poäng denna kyliga juniafton då man behöll fler och fler spelare i försvarsposition allt eftersom klockan tickade mot 90 minuter.\nIggarna å sin sida försökte trycka på för ett segermål och efter att Dennis Backström tagit sig fram på vänsterkanten hamnar bollen till slut hos Mikael Andersson som även han stod för ett piggt inhopp och han gör allt rätt då han drar till med en snabb tåfjutt som jag tror går tunnel på målvakten men lagom som vissa av de ditresta IIK-supportrarna börjat jubla så dyker en försvarare upp och lyckas rensa undan bollen i allra sista sekund.\nEn till gyllene chans tillföll Iggarna. Viktor Jansson dribblar sig fram på högerkanten och skapar sig utrymme för ett inlägg. Vid första anblicken ser det ut att gå för långt men vid den bortre stolpen dyker Olivier Lindh upp och skjuter ett lågt skott som målvakten gör en mycket kvalificerad räddning på och ser till att Iggarna fick nöja sig med en poäng.\n\nVisst kan man säga att Iggarna var närmast segern och visst var det så att man hade det mesta av bollen. Men Norrala gör det bra och kändes långt ifrån ofarliga då dem gick till anfall och till skillnad från matchen mot Edsbyn kan man hävda att det inte var helt orättvist med delad pott.\n\nLaget: (4-4-2)\nMathias Svärd – Fredric Lindh, Lars Skärpe, Erik Sundman, Dennis Backström – Robin Stigevik, Tobias Björk, Fredrik Rahm, Emil Hallberg – Daniel Wester, Mattias Samuelsson\n\nAvb. Viktor Jansson, Mikael Andersson, Victor Hallberg, Dennis Baban, Martin Lööf, Olivier Lindh, Fredrik Nord-Norén\n\nMatchens plus:\n+++ Mathias Svärd\n++ Lars Skräpe\n+ Erik Sundman\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2660283>Matchfakta</A>",
