    id: "8d70700b-846a-40be-aa32-1b227a8f6f73",
    title: "Korskrogens IK - IIK Dam",
    text: "Trist avslut på vårsäsongen i en väldigt svängig match där hemmalagets effektivitet till slut fällde avgörandet.\n\nIggarna började piggt och skapade snabbt ett bra läge för att ta ledningen få Elin Lindqvist fint framspelad av Linnea Persson kom fram i ett bra läge men avslutet gick tyvärr utanför.\nIstället är det Korskrogen som tar ledningen detta efter en fint slagen hörna där bollen i röran hamnar hos en KIK-spelare som kan slå in den från nära håll. Efter målet är det ett rätt klart spelövertag för Iggarna men dem allra hetaste chanserna för kvittering uteblev.\nOfta var det Linnea Persson och Elin Lindqvist som kom fram i något halvläge men inget som blev riktigt farligt. Och allt eftersom halvleken led mot sitt slut jämnade matchbilden ut sig och även Korskrogen lyckades skapa några halvchanser men inte heller för dem var det någon gång riktigt när och 1-0 stod sig till halvtidsvilan.\n\nDen andra halvleken hann inte blir speciellt gammal alls innan Elin Lindqvist blir fälld i straffområdet med straffspark som följd och där agerade Fanny Westman hur säkert som helst och sätter kvitteringen. Iggesund fortsatte att ha kommandot efter det och inte långt senare får Elin Lindqvist bollen någon meter utanför straffområdet och klipper till med en fin träff rakt i ribban, men innan man han sucka för det uteblivna målet studsar bollen turligt för gästerna ner i ryggen på Korskrogens målvakt och in i mål.\nInledningen på andra halvlek fortsatte att vara händelserik och strax efter ledningsmålet är det nära att KIK kan kvittera efter en snygg skarvning i djupled men Evelina Fredin agerade säkert i målet och kunde avstyra. Men så grinar oturen IIK i ansiktet, Korskrogen ställer om snabbt på Iggarnas vänsterkant och tar sig in i straffområdet. Och när Julia Andersson försöker ta sig på rätt sida om anfallaren hakar hon oturligt ihop med anfallaren som faller och domaren pekar på straffpunkten.\nRetfullt nog är det också riktigt nära att Fredin ska rädda straffen men den går in precis utom räckhåll och kvitteringen är ett faktum.\nSakande den första halvleken målchanser så var det verkligen inte fallet i den andra för bara minuter efter Korskrogens kvittering får Linnea Persson bollen 10 meter utanför straffområdet och med stor kraft och vilja lyckas hon slita sig lös och kommer fri med målvakten, väl där drar hon till med en snabb tåfjutt som målvakten inte hinner reagera ordentligt på och bollen går via målvaktens fingrar in vid den högra stolpen.\nEfter det målet lugnade det sig en aning och matchen blev rätt jämn där Korskrogen av naturliga skäl var dem som tryckte på mest framåt men IIK är inte alls ofarliga och det är inte alls långt ifrån att Elin Lindqvist skulle öka på ledningen med ett distansskott som smiter strax över ribban.\nMen istället för att IIK fick gå på knock så kvitterar Korskrogen då dem återigen ställer om i en snabb och rak kontring längs IIKs vänsterkant och slår ett inlägg som en anfallare bara försöker få en fot på och kan något turligt styra in bollen mycket snyggt i det bortre hörnet.\nEfter kvitteringen får KIK ny energi och det känns som att gästerna mattas av något. Övertaget för Korskrogen var inte markant men det fanns där och nog hade man i det här läget kunna hävda att det oavgjorda resultatet var rättvist. Men i slutet av matchen är Korskrogen hetare och slår en lång frispark från mittplan som snyggt skarvnickas in i mål och bara några minuter senare punkterar hemmalaget tillställningen genom att göra 5-3 på en hörna.\n\nSett över 90 minuter var det här en match där inget av lagen var värda att stå som förlorare men KIK var dödligt effektiva och oroade så fort dem fick en fast situation och det fällde avgörandet denna afton.\n\nLaget: (4-4-2)\nEvelina Fredin – Angelica Tagg, Elin Tegenfeldt, Julia Andersson, Fanny Westman – Matilda Brink, Emma Trönnhagen, Isabel Brink, Frida Borin – Elin Lindqvist, Linnea Persson\n\nAvb. Cajsa Vedin, Sara Åkerlund, Anna Lindblom, Emma Borin, Erika Strandell",
