    id: "f081de29-94e2-47d7-a456-d8dfa7daa62d",
    title: "Bollnäs GIF FF - IIK Dam",
    text: "<img src=http://arkiv.iggesundsik.se/bildarkivet/IIK-1717.jpg alt=1414>\n\nNy seger och ny nolla för Iggarna då Bollnäs slogs tillbaka efter en något knackig start.\n\nDet syntes att Iggarna hade haft ett litet uppehåll i matchschemat för i matchinledningen var det inte mycket som stämde i passningsspelet. Och mest tack vare att man i grunden är ett starkare lag kunde man få ett övertag på sina värdar.\nMatchens första chans tillföll Iggarna och Emma Trönnhagen som flyttat upp på en hörna men hennes nick gick tyvärr över ribban.\nIggarna fick som sagt inte spelet att stämma något vidare under den första halvleken och det var få anfall som innehöll några längre kombinationer. Istället är det nära att Bollnäs kan ta ledningen då en anfallare står för en fin soloprestation och lyckas ta med sig bollen genom iggesundsförsvaret och får ett friläge men som tur var gick avslutet över ribban.\nMen bra lag har tur brukar det heta och istället för ett mål bakåt så kunde man ta ledningen då Johanna Ohlsson löpt in centralt i banan, vinner två motlägg med försvararna och fri med målvakten gör hon inga misstag och rullar in ledningsmålet för IIK.\nMen innan halvtidsvilan så var det nära igen för Bollnäs då man dräller med bollen i backlinjen och kan vinna tillbaka bollen i farligt läge men även denna gång lämnar avslutet en del att önska för Bollnäs så man kan gå till paus med en 1-0-ledning.\n\nAndra halvlek är märkbart bättre än den första och nu glimtar man faktiskt till och kommer åtminstone stundtals upp i normal standard. \nOch ganska snart får man utdelning då Sara Åkerlund slår en väl avvägd boll i djupled till Isabel Brink som rundar den utrusande målvakten och rullar in tvåan.\nNu fick Iggarna till mer än ett skenbart övertag då man äger bollen under betydligt längre perioder än i första och ytterligare utdelning fick man när Linnea Persson tar emot bollen och sätter den i djupled till Sara Åkerlund som visar prov på ypperlig spelförståelse då hon spelar den i sidled till Angelica Tagg som får öppet läge och kan placera in den utom räckhåll för målvakten.\nNu sticker Bollnäs upp och får ett gyllene läge för reducering efter en snabb kontring där bollen studsar med dem ett par gånger och helt plötsligt har en anfallare fritt läge till höger i straffområdet men även denna gång höll avslutet låg kvalité.\nSå istället för en reducering utökar IIK då Ida Tilemo bryter ett uppspelförsök på högerkanten och spelar Isabel Brink i djupet som i sin tur hittar in till skyttedrottningen Linnea Persson som styr in 0-4.\nEfter det målet känns det som att Iggarna slår av lite på takten och mest bevakar sin ledning och att luften gått ur Bollnäs helt.\nMen de tillresta IIK-supportrarna som dessutom var klart fler än hemmasupportrarna fick jubla en gång till då Fanny Westman får bollen i straffområdet i efterspelet av en hörna, gör inte några misstag och sätter bollen säkert intill stolpen och fastställer slutresultatet.\n\nDet här var en match man vinner mer på grund av att man är ett i grunden bättre lag än att man spelar så mycket bättre än sina motståndare. Och även om andra halvlek var ett stort fall framåt och man visade upp flera fina kombinationer så är det skönt att veta att det finns mer att ta av inför seriefinalen mot Delsbo på söndag.\n\nLaget: (4-4-2)\nEvelina Fredin – Fanny Westman, Johanna Skarin, Emma Trönnhagen, Frida Borin – Matilda Brink, Sara Åkerlund, Isabel Brink, Johanna Ohlsson – Anna Lindblom, Linnea Persson\n\nAvb. Ida Tilemo, Angelica Tagg\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2662797>Matchfakta</A>",
