    id: "62032ae0-9fc1-445a-947f-1e55895f901d",
    title: "IIK Herr - Enångers IK",
    text: "<img src=http://arkiv.iggesundsik.se/bildarkivet/IIK-1719.jpg alt=1415>\n\nDerbyseger och en fantastisk inramning satte guldkant på lördagen för alla Iggare.\n\nMatchen tog den karaktär man förväntat sig, Enånger föll långt hem och överlät bollhållandet till Iggesund som i matchinledningen hade svårt att få upp tempot nog för att skapa några heta chanser mot det täta enångersförsvaret.\nNågot oväntat är det Enånger som tar ledningen och släkten är ju värst som det brukar heta. Andreas Midell får bollen på högerkanten efter ett misslyckat brytningsförsök och slår vad som är tänk som ett inlägg men det blir missriktat och går mot mål och missbedöms av Sondell så bollen går in vid den bortre stolpen. \nEfter det blir det lite stirrigt hos Iggarna som har svårt att få till spelet under en period men allt eftersom så tar man till slut tag i händelserna igen.\nRiktigt heta började man blir efter ett riktigt snyggt anfall som slutar med att Olivier Lindh får bollen på högerkanten och slår ett inlägg till Sundman som han tar ned på bröstet och skjuter ett skott som tyvärr går strax utanför stolpen.\nEIK kämpade för att kunna behålla sin ledning till halvtid och backade hem till eget straffområde med allt utom sina anfallare. Och då gäller det att ta tillvara på chanserna när de dyker upp. Det gjorde Emil Hallberg då han bryter en passning och skjuter ett vasst skott som målvakten får fingrarna på min inte har en chans att styra utanför stolpen och sätter kvitteringen.\nOch innan halvtidsvilan är det nära att den hårt jobbande Mattias Samuelsson får utdelning på sitt slit då han störtar mot första stolpen och skarvar ett inlägg från Lindh med klacken men den går precis utanför den bortre stolpen och 1-1 står sig halvleken ut.\n\nDen andra halvleken är den första lik i det hänseenden att Enånger överlåter initiativet till Iggesund och hoppas på att kunna hitta in med en snabb boll bakom iggesundsförsvaret men det håller ju som bekant hög klass så man hade bra kontroll på händelserna.\nOch det dröjer bara några minuter innan man kan ta ledningen då Lindh får bollen på högerkanten och slår ett inlägg som blir lite för långt men Emil Hallberg hinner upp det och nickar tillbaka in till Samuelsson som dundrar in bollen via ribban och springer ut och firar målet tillsammans med Slaggbergs Ultras som gav matchen en fantastisk inramning.\nMatchbilden ändras inte av Iggarnas ledningsmål utan fortsätter på samma sätt. Inte förrän dryga timmen var spelad gjorde Enånger några ansatser att försöka flytta fram sina positioner och det lyckades man egentligen bara med de gånger man fick fast bollen på fötterna hos Andreas Midell. Och det dröjer inte innan det var IIK som hade kommandot igen.\nNärmast för Iggesund var Daniel Wester som ersatt Mikael Andersson i halvtid då han fick en mycket fin passning från Sundman in bakom backlinjen men han fick inte till avslutet riktigt och målvakten räddar.\nNu väntade en nervös avslutning då EIK tryckte upp allt man hade och en ettmålsledning är ju alltid vansklig oavsett hur matchen ser ut. Men Iggarna behåller kylan och spelar av matchen utan att det är riktigt nära att Enånger kvitterar.\n\nKanske inte den allra mest publikfriande match som spelats på Movallen i år men det är sällan fallet med ett derby. Och sett över 90 minuter var det inget snack om att bästa laget vann.\n\nLaget: (4-4-2)\nMikael Sondell – Fredrik Nord-Norén, Lars Skärpe, Marcus Larsson, Dennis Backström – Olivier Lindh, Erik Sundman, Emil Hallberg, Viktor Jansson – Mattias Samuelsson, Mikael Andersson\n\nAvb. Dennis Baban, Daniel Wester, Glenn Sjögren, Edin Kamberi\n\nMatchens plus:\n+++ Emil Hallberg\n++ Erik Sundman\n+ Mattias Samuelsson\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2660331>Matchfakta</A>",
    score: "2-1",
