    id: "abbc0e9d-e0da-43e7-8d0b-7ad369406372",
    title: "IIK Dam - Delsbo IF",
    text: "Seriesegern fortfarande inom räckhåll efter ett sent kvitteringsmål efter en jämn match mot Delsbo.\n\nIggarna startade matchen piggt och redan i matchens första minut skapar man ett läge då Isabel Brink drar iväg längs högerkanten och spelar in till Linnea Åkerlund som testar ett skott från distans som målvakten med viss möda kan få kontroll på.\nOch det var inte långt undan att Linnea Persson kunde komma lös i djupled efter en nickskarv av samme Brink. Efter den pigga starten jobbade sig Delsbo in i matchen utan att direkt skapa några heta chanser då hemmalaget helt klart gjort läxan och visste hur Delsbo försökte anfalla precis varje gång de får bollen.\nOch allt eftersom tar Iggarna tillbaka initiativet men även åt det hållet var det sparsmakat med riktigt heta chanser. Linnea Persson var den som var närmast då hon rinner igenom till höger i straffområdet och försöker sig på ett överraskande tidigt avslut men det gick tyvärr utanför stolpen.\nOch så mycket mer hände inte i den första halvleken utan Iggesund kontrollerade mest av bollinnehavet och Delsbo försökte ställa om snabbt och inget av lagen hade några större framgångar när det gällde chansskapandet och 0-0 stod sig halvleken ut.\n\nÄven andra halvlek inleddes på samma sätt och det dröjde innan det hettade till och då var det Delsbo som var nära efter ett långt och högt inlägg som Fredin får sträcka ut ordentligt på och fredar målet och tack vare en rensning i sista sekunden av Emma Trönnhagen så är nollan intakt.\nNu följde en period som gick Delsbos väg och inte långt senare tilldelas gästerna en straff efter att Trönnhagen något olyckligt fått bollen på handen. Straffskytten gjorde inga misstag och satte straffen mycket snyggt i Fredins högra kryss helt utom räckhåll.\nDet tar en liten stund men allt eftersom repar Iggarna mod och tar kommandot i matchen och inleder jakten på kvittering. Det var nära flera gånger om men aldrig så där självklart utan det tuffa delsboförsvaret såg till att alla avslut kom i pressade situationer för IIKs del. Fanny Westman fick något i blicken vid ett tillfälle och fullkomligt viner förbi flera delsbospelare på högerkanten och uppfattar att målvakten är långt ute och drar iväg ett skott från långt håll. Men marginalerna var med Delsbo och målvakten när precis bollen och lyckas rädda.\nJakten fortsatte och klockan tickade skoningslöst på mot 90 minuter spelade och det såg tufft ut. Men tjejerna visade upp en påtaglig frustration över det innevarande resultatet och kämpade frenetiskt på. Och tillslut får man utdelning när Johanna Ohlsson får utrymme på vänsterkanten växlar hon tempo och drar ifrån sin försvarare och kommer fram till vänster om straffområdet där hon lyfter in bollen måhända lite på chans men ack så lyckat det blir. Bollen går i en perfekt båge över målvakten och kvitteringen var ett faktum.\nEfter det återstod inte speciellt lång tid och inget av lagen hade någon egentlig ork att inleda en jakt på ett ledningsmål så 1-1 blev slutresultatet.\n\nDet här kan man säga var ett typiskt toppmöte, jämnt tillknäppt och inte någon överflöd av målchanser. Och det är svårt att säga annat än att oavgjort var ett rättvist resultat.\nMen en viktig sak vi kan ta med oss är att Johanna Ohlssons mål såg till att Iggarna fortfarande har chansen till serieseger i sina egna händer och Delsbo kommer få nervöst titta på och hoppas att Iggarna tappar poäng.\n\nLaget: (4-4-2)\nEvelina Fredin – Fanny Westman, Emma Trönnhagen, Johanna Skarin, Angelica Tagg – Matilda Brink, Sara Åkerlund, Linnea Åkerlund, Johanna Ohlsson – Isabel Brink, Linnea Persson\n\nAvb. Ida Tilemo, Elin Lindqvist, Cajsa Vedin, Julia Andersson\n",
