    id: "02a9cf84-4b5b-46f6-b3a7-3a687ff36a54",
    title: "Bollnäs GIF FF - IIK Herr",
    text: "<img src=http://arkiv.iggesundsik.se/bildarkivet/IIK-1721.jpg alt=1418>\n\nIdag får ni ursäkta om det skulle ett lite väl segerrusigt referat. Men jag lovar att göra mitt bästa för att beskriva matchen så rättvist som möjligt.\n\nAtt möta seriesuveränen Bollnäs är aldrig en enkel uppgift men ska man någon gång göra det är väl matchen efter att deras serieseger är säkrad ett bra tillfälle.\nTillsynes hade man gjort hemläxan noggrant och visade tillbörlig respekt för Bollnäs anfallsspel medan deras förvar som inte håller riktigt samma kvalité sattes under hård press då tillfälle gavs.\nDet gav en matchbild där Bollnäs inledningsvis kontrollerade mycket av bollinnehavet medan det heta chanserna tillföll IIK.\nEfter bara några minuter är det nära att Samuelsson kan ge Iggesund ledningen efter ett vaket agerande då han snappar upp en misslyckad hemåtnick.\nNu följde en lång period då Bollnäs har väldigt mycket boll men inte skapar några riktigt heta chanser mot det stabila iggesundsförsvaret. \nOch när knappa kvarten var spelad gav Iggesunds tålamod och väl valda tillfällen att sätta press utdelning. En bollvinst då Bollnäs är i full färd med att flytta fram positionerna ger Stigevik utrymme på högerkanten och han hittar in med ett fint inlägg till Emil Hallberg som möter på volley, men bollnäsmålvakten visar varför han blev utsedd till augustis bästa spelare i division fyra och gör en riktigt vass reflexräddning och lyckas få ut bollen till hörna.\nFasta situationer skulle visa sig vara nyckeln för IIK och när Bollnäs inte håller tillräcklig koll på Sundman vid en hörna har han inga större bekymmer att nicka in Janssons fina leverans och ge Iggarna ledningen efter 20 minuters spel.\nMed målet i ryggen tog IIK över taktpinnen från sina värdar och visade att man faktiskt kunde föra matchen också.\nIggarna fortsatte att vara farliga vid hörnor och var inte alls långt ifrån att utöka ledningen efter en period där man spelat riktigt bra. Men istället grinar oturen Iggesund i ansiktet då Bollnäs kontrar och en spelar går omkull i duell med Dennis Backström inne i straffområdet och domaren väljer att peka på straffpunkten. Och på den gör inte Bollnäs och hela seriens skyttekung några misstag utan sätter säkert 1-1.\nEfter kvitteringen sätter Bollnäs lite mer fart igen och matchbilden liknar mer den som var i matchens inledning. Och det är inte långt undan att Bollnäs kan ta ledningen då man inte är riktigt ense om vem som ska kliva upp i press och en bollnässpelare får avancera helt ohotad mot IIKs straffområde men tack och lov stryker skottet utsidan på stolpen. Och stunden senare får Sondell komma till räddningen med en fin fotparad efter ett snyggt dribblingsnummer från en bollnäsanfallare. Men 1-1 står sig halvleken ut.\n\nDen andra halvleken forstatte på ett likande sätt och Bollnäs skapade viss press utan att få de där riktigt heta chanserna. Utan precis som tidigare tillföll dem Iggesund, närmast var Viktor Jansson som satte en boll klockrent i stolpen och på returen var det inte långt undan att Emil Hallberg skulle ge Iggarna ledningen men målvakten är bra ute.\nDen andra halvleken vaknar inte riktigt till förrän det återstod dryga tio minuter av matchen då Iggarna verkligen gick för att få till ett segermål. Vilket medförde att man öppnade upp sig bakåt för kontringar och det är inte långt undan att Bollnäs kan ta ledningen med bara några minuter kvar att spela då en anfallare kommer helt fri men avslutet håller inte lika hög kvalité som förarbetet och går utanför stolpen.\nIstället kommer Iggarna fram och får en sista chans, Dennis Backström slår ett inlägg som hittar fram till Stigevik som skjuter ett pressat skott som täcks undan till hörna. \nPå den hörnan som studsar än hit och än dit inne i straffområdet hittar bollen tillslut fram till Erik Sundman som kan sätta 1-2 och ge Bollnäs deras första förlust för säsongen.\n\nEn fantastiskt spännande tillställning för oss tillresta och vilken moral Iggarna visar prov på. Sen kanske ett oavgjort resultat hade varit det mest logiska sett till matchbilden men vad gör väl det en dag som denna. Något som däremot är tråkigt att se är att väldigt många av bollnässpelarna bara kliver rakt av planen efter slutsignal utan att tacka för matchen. Lite större sportslighet än så kan man väl som klara seriesegrare visa prov på även om man just åkt på säsongens första förlust.\n\nLaget: (4-4-2)\nMikael Sondell – Fredrik Nord-Norén, Lars Skärpe, Marcus Larsson, Dennis Backström – Robin Stigevik, Erik Sundman, Tobias Björk, Viktor Jansson – Emil Hallberg, Mattias Samuelsson\n\nAvb. Mikael Andersson, Olivier Lindh, Daniel Wester, Dennis Baban, Jonatan Sondell, Patrik Åslin\n\nMatchens plus:\n+++ Erik Sundman\n++ Lars Skärpe\n+ Marcus Larsson\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2660338>Matchfakta</A>",
    score: "1-2",
    date: "2014-09-20",
    team: "22356aed-4d9a-47f6-b762-575cb9c368da",
