    id: "789b9019-2c89-4c94-b127-1d0d975b2986",
    title: "IIK Dam - Korskrogens IK",
    text: "Snacka om att det var upplagt för en rafflande avslutning i division 3. Iggarna tog emot Korskrogen och båda lagen skulle stå som slutsegrare vid vinst. Skulle lagen däremot dela på poängen, ja då var det Delsbo som skulle ta hem det hela.\n\nMatchen inleddes piggt av Korskrogen som hade ett rejält övertag i bollinnehav utan att skapa några direkta chanser men släppte heller inte till några då Iggarna hade svårt att få fast bollen på offensiv planhalva så det bådade inte helt gott inledningsvis.\nMen mitt i pressen från Korskrogen får Isabel Brink bollen på högerkanten och rycker ifrån en försvarare innan hon hittar in med ett inlägg till Persson som möter på volley men avslutet går tyvärr mitt på målet. Och i anfallet efter får samme Persson ett friläge lite till skänks men den här gången går avslutet över ribban.\nChanserna stärker modet på hemmalaget och matchbilden förändras till vad som inte kan beskrivas annat än som ett ställningskrig där inget av lagen skapar några målchanser.\nDesto längre matchen led skapade Iggarna sig ett övertag och tillslut var rollerna ombytta. Men några riktigt heta chanser skapade man inte. Närmast var Isabel Brink som nickade en skarvad hörna men hon får ingen riktig fart på bollen så den vållar inte några bekymmer för målvakten i Korskrogen.\nFasta situationer var det som oroade mest för båda lagen då både Iggarna och Korskrogen var nära att kunna forcera in bollen efter hörnor men i båda fallen var det en försvarare som han fram i sista sekund och 0-0 stod sig halvleken ut.\n\nI andra havlek känns Iggarna helt klart som det vassare laget och skapar tryck omedelbart då Ohlsson rinner igenom och tvingar målvakten till en bra räddning. Och bara någon minut senare är det nära att Korskrogen ställer till det för sig själva då det blir en kommunikationsmiss och en försvarare lyfter bollen över egen målvakt som rusat ut och Elin Lindqvist kan sånär ge Iggarna ledningen men en försvarare hinner tillbaka i sista sekund.\nNu följer en period där man kan se att båda lagen hade mycket som stod på spel då det blir lite krampaktigt och inte speciellt mycket ordnat spel. Mitt i den perioden vinner Lindqvist en duell med en av mittbackarna och kommer fri med målvakten som är långt ute och väljer helt rätt att försöka lyfta bollen över henne men på något vis lyckas hon med en makalöst akrobatisk räddning och fredar målet. Det krampaktiga spelet börjar ge med sig och Iggarna började få ett övertag ånyo på sina gäster. Och Korskrogens målvakt tvingas komma ut stort vid flera tillfällen.\nMen så kommer den stora chansen, Johanna Ohlsson som vållade stora bekymmer med sin snabhet kommer igenom men blir upphakad i straffområdet så domaren blåser och pekar på straffpunkten.\nFram stegar Fanny Westman som tillsynes inte alls var tagen av stundens allvar och sätter straffen hur säkert som helst.\nNu börjar en kamp mot klockan. Men Korskrogen har svårt att ta över kontrollen i matchen och skapar inte några chanser som sätter den alltid så trygge Fredin i målet på några större prov. Istället är det faktiskt Iggesund som har en boll i nät då Johanna Ohlsson trampar runt och går förbi innan hon spelar snett inåt bakåt till Lindqvist som sätter bollen i mål men på något vis anser domaren att det är offside och dömer bort målet.\nMen 1-0 räcker för Korskrogen lyckas inte komma närmre och ett gäng trötta men lyckliga tjejer får lyfta armarna mot skyn och jubla över seriesegern och avancemang till division 2!\n\nLaget: (4-4-2)\nEvelina Fredin – Fanny Westman, Johanna Skarin, Emma Trönnhagen, Angelica Tagg – Matilda Brink, Sara Åkerlund, Linnea Åkerlund, Elin Lindqvist – Linnea Persson, Isabel Brink\n\nAvb. Johanna Ohlsson, Julia Andersson, Ida Tilemo, Cajsa Vedin, Anna Lindblom, Emma Borin\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2662807>Matchfakta</A>",
