    id: "132841ec-e31e-4614-9195-5377012da3ce",
    title: "Svärdsjö IF - IIK Herr",
    text: "Det finns mycket att säga om den här matchen men det trista faktumet är at Iggarna fick se sig besegrade efter att misslyckats med att komma upp i normal standard.\n\nDet syntes att man var tagna av stundens allvar när matchen blåstes igång då man inte fart på varken boll eller fötter inledningsvis. Ändå var det Iggarna som skapade den första heta chansen då Samuelsson vinner en frispark ute på vänsterkanten som Jansson slår fint till Sundman som värker sig fram men lyckas inte styra nicken på mål.\nSvärdsjö får mer och mer av bollen utan att skapa några direkt heta chanser även om det var riktigt nära en gång men då stod Tobias Björk för en exceptionell brytning och Sondell i målet slapp ingripa.\nHemmalaget försökte flera gånger sätta riktigt hög press på sina gäster och lyckades helt okej i den mening att det tog tid gör Iggarna att gå till anfall för de allra flesta situationer redde man ut på ett tryggt sätt. \nEfter drygt tio minuters spel har faktiskt IIK en boll i nät. Jansson kommer fram på vänsterkanten och slår ett inlägg mot Wester som helt tydligt springer och tänker på vårmötet med Enånger för han drar till med en cykelspark, målvakten räddar bollen men inte bättre än att den hamnar hos Stigevik som nickar in den men tyvärr lyfter linjedomaren sin flagga för offside.\nSvärdsjö tog över allt mer och kontrollerade nu väldigt stor del av bollinnehavet men utan att skapa några farligheter. Men när man börjat vänta på halvtidsvisslan händer något mindre roligt. En lång boll släpps hem mot Sondell i målet som springer ut för att plocka upp den. Då kommer en Svärdsjöspelare som skjuten ur en kanon och kastar sig fram och sparkar undan bollen under händerna på Sondell samtidigt som han springer rakt in i sidan på honom så båda far i backen. Domaren blåser i pipan och efter en stunds förvirring inser alla att det är straff för Svärdsjö och inte frispark för IIK. Straffen slås i mål och direkt på efterföljande avspark blåses det för halvtidsvila.\n\nTidigt i andra halvlek skapar SIF en riktigt het chans. Efter att ha kombinerat sig fram snyggt på högerkanten slår de ett lågt inlägg som en anfallare möter på ett tillslag men Sondell gör en snygg räddning och styr undan till hörna.\nNu börjar Iggarna äta sig in i matchen men istället för en kvittering gringar oturen Iggarna i ansiktet då Svärdsjö kommer fram igen på sin högerkant och slår ännu ett långt inlägg men den här gången slås den oturligt i mål av Skärpe som försökte rensa undan bollen.\nMen inte långt efter det drar en svärdsjöspelare på sig sin andra varning och Iggesund får spela med en man mer. Det stärker självförtroendet hos gästerna som flyttar fram sina positioner och skapar hårt tryck på Svärdsjö som nu bara spelar på resultatet.\nEfter dryga timmen kommer reduceringen, Iggarna får inkast högt upp på högerkanten och det skarvas in mot Stigevik som skjuter ett skott som målvakten inte lyckas styra utanför stolpen och nu var man bara ett mål ifrån.\nPressen mot svärdsjömålet fortsatte och när Dennis Backström slår en lång frispark som målvakten tappar i stolpen och Samuelsson sånär kan slå in returen kändes en kvittering oundviklig.\nDet var nog många som trodde att den kom då Sundman slår en fin passning i djupled till Samuelsson som blir ensam med målvakten. Han lyckas inte få avslutet förbi den utrusande målvakten men returen studsar till Wester som nickar bollen förbi den överspelade målvakten och över en sista försvarare. Då händer det obegripliga, försvararen hoppar upp och med hjälp av en utsträckt hand styr han bollen utanför stolpen. Nu väntar alla på signal för straffspark och ännu ett rött för Svärdsjö, men på något vis har domaren inte sett vad som hänt så var hans blick var vänd känns oklart. Naturligtvis vilda protester från IIK men till ingen nytta såklart.\nMan tvingades istället jaga vidare och nu började goda råd bli dyra. Det är väl ingen överdrift om man påstår att marginalerna inte var på IIKs sida denna eftermiddag för när Stigevik vinner en duell med en försvarare och snyggt placerar in bollen intill den vänstra stolpen viftar linjemannen med sin flagga och tycker att han gjort sig skyldig till en frispark.\nNu gick luften lite ut Iggarna samtidigt som Svärdsjö gjorde det riktigt bra i sitt tidsfördröjande spel och när IIK flyttar fram allt vad man har så kan istället SIF kontra in 3-1 på stopptid.\nMen det vart inte det sista som hände utan nästan direkt utnyttjar Emil Hallberg sjabbel i försvaret hos Svärdsjö då han snyggt tar med sig bollen på ett tillslag och sedan kliniskt sätter bollen intill stolpen. Men mer tid fanns inte att spela på och Iggesund fick se sig besegrade i en match man lika gärna kunnat vinna om inte om vore just om.\n\nLaget: (4-4-2)\nMikael Sondell – Emil Hallberg, Lars Skärpe, Marcus Larsson, Dennis Backström – Robin Stigevik, Tobias Björk, Erik Sundman, Viktor Jansson – Mattias Samuelsson, Daniel Wester\n\nAvb. Olivier Lindh, Glenn Sjögren, Fredrik Nord-Norén, Jonatan Sondell, Hans Ohlsson\n\nMatchens plus:\n+++ Erik Sundman\n++ Viktor Jansson\n+ Lars Skärpe\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2898099>Matchfakta</A>",
