    id: "9eb4920c-5ae2-4ea6-b2cc-05590b489d01",
    title: "IIK Herr - Hofors AIF",
    text: "Förutsättningarna var enkla, det gällde att vinna för att hoppet om spel i division tre skulle leva vidare.\n\nMatchen började avvaktande och det dröjde ett tag innan något lag kunde ta tag i händelserna och då var det Hofors som till slut drog längsta strået och skapade några riktiga farligheter på hörnor. Och den matchbilden med Hofors som spelförande och Iggesund som mest försökte ställa om snabbt fortgick fram till ungefär 20 minuter var spelade då en hoforsspelare slår ifrån sig bollen efter avblåsning och drar på sig in andra varning och helt plötsligt var Iggarna bjudna tillbaka in i matchen.\nDet utnyttjade man på bästa sätt då Strid avancerar in på offensiv planhalva längs högerkanten och slår ett tidigt inlägg till Wester som tagit en löpning in i straffområdet snett från vänster. Han vräker sig fram och styr med utsidan av foten bollen i en båge förbi målvakten och in vid den högra stolpen mycket snyggt.\nDet numerära övertaget för IIK blev påtagligt och nu svängde matchbilden till hemmalagets favör och nu skapade man också flera heta chanser, Emil Hallberg var riktigt nära på ett friläge men han tvingas ut mot vänster och tvingas ta avslut med sin sämre fot och han får ingen riktig träff.\nIggarna fortsatte att tycka på och nog var det värt ett bättre öde då Jansson lyfter bollen över backlinjen till Emil Hallberg som blir helt fri och lyfter bollen över den utrusande målvakten men får mycket retfullt se sitt avslut gå rakt i ribban.\nHofors kunde begränsas till mestadels korta anfall och enda gångerna de oroade ordentligt var vid fasta situationer.\nDen sista chansen för halvleken tillföll Iggarna och nog borde Wester ha fördubblat sin målskörd då han blir helt friställd i straffområdet av Tobias Björk men avslutet brister tyvärr både i kraft och precision så 1-0 står sig till vilan.\n\nI andra halvlek känns det som att Iggesund blir lite tagna på sängen av de förändringar Hofors gjort för nu lyckades de trots numerärt underläge sätta ordentlig press på Iggesund som hade problem med organisationen och dessutom förtvivlat svårt att få upp laget efter att man vunnit tillbaka bollen och det är inte långt undan att Hofors kvitterar då man faktiskt får bollen förbi Sondell i en kaosartad situation men Martin Strid dyker upp som en räddande ängel och rensar på mållinjen.\nHoforspressen fortsätter och Iggarna har det nu väldigt tufft under en längre period då gästerna kom i våg efter våg och skapade en del farligheter ofta i form av inlägg där man var riktigt vassa men nickade inte firma Skärpe/Larsson undan bollarna stod Sondell där som en säker sista utpost och fick göra några riktigt svettiga räddningar.\nMen när utdelningen uteblev mattades Hofors spel av och Iggesund kunde ta sig tillbaka in i matchen men det blev en ryckig matchbild, mycket såklart eftersom Hofors tvingades jaga på framåt och Iggesund gavs ytor som man kanske inte gjorde allt för att utnyttja då man var rädda om den ledning man redan hade.\nNu spelade Iggarna mest på klockan och Hofors verkade tröttkörda. När sedan gästerna valde att byta ut sin spelmotor på mittfältet lyckades de inte få någon längd alls på sina anfall längre och IIK kunde med ett undantag hålla dem borta från heta chanser.\nMen vilken chans de fick Hofors, när Iggarna flyttar fram mycket folk vinner de tillbaka bollen och ställer om blixtsnabbt vilket resulterar i ett öppet läge till vänster i straffområdet men som tur var lämnade avslutet en hel del att önska för gästerna då det gick högt över ribban. \nI övrigt var den mest skott från distans och några nickar där IIK hade rätt bra kontroll. Sista chansen tillföll istället Iggarna efter att Hofors dragit på sig ännu en utvisning med fyra minuter kvar att spela.\nDen chansen gick till Olivier Lindh som under sitt korta inhopp han vara inblandad i flera farligheter då han avancerade fram på högerkanten och sköt ett skott som strök strax utanför stolpen.\nHorfors gör ett sista desperat försök då man skickar upp precis alla efter att ha fått en frispark på mittplanen men Iggarna kan hålla undan.\n\nDet här var en mycket speciell match mot ett lag som faktiskt är riktigt duktiga även om de inte fått någon utdelning under kvalspelet. Och när Iggarna till skillnad från matchen innan har marginalerna på sin sida så kan man hålla undan i en tät tillställning. \n\nLaget: (4-4-2)\nMikael Sondell – Martin Strid, Lars Skärpe, Marcus Larsson, Dennis Backström – Robin Stigevik, Erik Sundman, Tobias Björk, Viktor Jansson – Daniel Wester, Emil Hallberg\n\nAvb. Fredrik Nord-Norén, Mikael Andersson, Olivier Lindh, Glenn Sjögren, Niclas Lindström, Hans Ohlsson\n\nMatchens plus:\n+++ Erik Sundman\n++ Daniel Wester\n+ Tobias Björk\n\n<A HREF=http://halsingland.svenskfotboll.se/match/?scr=result&fmid=2898101>Matchfakta</A>",
    score: "1-0",
